(48, 19, NULL, 'Indeks Sistem Merit', NULL, 'Manajemen karier belum mengacu pada talent pool dan rencana suksesi (manajemen talenta)', 'RSO 23.38.5.01', 'Kepala BKPSDM', '[\"Belum terlaksananya uji kompetensi terhadap seluruh pegawai\"]', 'Eksternal', 'C', '[\"Tidak ada jaminan kepastian karier yang jelas dan ASN tidak profesional dalam menjalankan tugas\"]', 'Perangkat Daerah, ASN dan masyarakat', '44', '44', '{\"dampak\":4.071428571428571,\"kemungkinan\":4.25,\"skala_risiko\":17.303571428571427}', '1). Melaksanakan uji kompetensi bagi calon JPT Pratama melalui seleksi terbuka;\r\n2) Melaksanakan uji kompetensi bagi sebagian ASN pejabat administrator dengan menggunakan assesment center secara bertahap setiap tahun;\r\n3) Penyusunan Raperbup tentang proses pengisian jabatan pimpinan tinggi secara terbuka dan kompetitif;\r\n4). Penilaian kelayakan oleh Tim Penilai Kinerja.', '1). Uji kompetensi hanya dilakukan pada sebagian pegawai;\r\n2). Belum dilaksanakan forum konsultasi publik;\r\n3). Uji kelayakan belum dapat sepenuhnya merepresentasikan potensi dan kompetensi ASN.', '1). Melaksanakan uji kompetensi dan menyusun talent pool;\r\n2). Melaksanakan uji kompetensi bagi sebagian ASN pejabat administrator dengan menggunakan assesment center secara bertahap setiap tahun;\r\n3). Menyusun talent pool berdasarkan hasil uji kompetensi pegawai secara bertahap;\r\n4). Penetapan Raperbup tentang proses pengisian jabatan pimpinan tinggi secara terbuka dan kompetitif;\r\n5).  Penilaian kelayakan oleh Tim Penilai Kinerja dengan mempertimbangkan hasil uji kompetensi.', 'Kepala BKPSDM', '12 bulan', '1). Uji kompetensi melalui assesment center yang terakreditasi;\r\n2). Form Performance Appraisial 360 derajat;\r\n3). Forum konsultasi publik;\r\n4). Berita Acara Tim Penilai Kinerja.', 'BKPSDM', 'Perangkat Daerah dan ASN Pemkab. Lamongan', '1). Tribulan I dan III 2023', '1). Tribulan I dan III 2023', 'Belum dilaksanakan', '1). Observasi dan reviu hasil uji kompetensi;\r\n2). Laporan hasil forum konsultasi publik;\r\n3). Reviu kinerja.', 'Kepala BKPSDM', 'Januari s/d Desember 2023', 'Januari s/d Desember 2023', 'Belum dilaksanakan', 'Oktober 2022', 'Tidak terpenuhinya kebutuhan alokasi anggaran untuk uji kompetensi terhadap seluruh pegawai;\r\nTidak terlaksananya uji kompetensi terhadap seluruh pegawai', 'Tidak ada jaminan kepastian karier yang jelas dan ASN tidak profesional dalam menjalankan tugas', '-', '2022-12-13 20:19:57', '2023-03-28 00:10:04'),
(49, 11, 'Pengadaan, Pemberhentian dan Informasi Kepegawaian ASN', 'Persentase data ASN yang valid', 'Pelaksanaan', 'Belum optimalnya sumber daya manusia/ ASN untuk meremajakan data secara mandiri di aplikasi SI-MEGILAN', 'ROO 23.38.5.01', 'Kepala Bidang Pengadaan, Pemberhentian dan Informasi Kepegawaian Aparatur', '[\"Kurangnya pemahaman dan koordinasi antar perangkat daerah di lingkungan Kabupaten Lamongan terhadap kevalidan data masing-masing ASN\"]', 'Eksternal', 'C', '[\"Kualitas data ASN di lingkungan Kabupaten Lamongan menjadi kurang optimal\"]', 'Pemerintah Kabupaten Lamongan dan masing-masing ASN', '44', '44', '{\"dampak\":3.1785714285714284,\"kemungkinan\":3.0357142857142856,\"skala_risiko\":9.64923469387755}', 'Monitoring dan evaluasi dengan melakukan rekon kepegawaian setiap tahun 2 kali. Rekon kepegawaian dilakukan di awal dan akhir tahun.', 'Pelaksanaan hasil rekon kepegawian belum maksimal dilakukan oleh semua ASN di Pemerintah Kabupaten Lamongan.', '1). Monitoring dan evaluasi rencana aksi kegiatan rekon kepegawaian dan dan bukti rekon kepegawaian secara mandiri;  \r\n2). Memberikan himbauan untuk melakukan peremajaan data ASN secara mandiri.', 'Kepala Bidang Pengadaan, Pemberhentian dan Informasi Kepegawaian Aparatur', '12 bulan', 'Aplikasi SI-MEGILAN', 'Bidang Pengadaan, Pemberhentian dan Informasi Kepegawaian Aparatur', 'Perangkat Daerah', 'Tribulan I s/d IV 2023', 'Tribulan I s/d IV 2023', 'Belum dilaksanakan', '1) Reviu hasil rekon data Kepegawaian;\r\n2. Melakukan verifikasi data ASN di Aplikasi  SI-MEGILAN.', 'Kepala Bidang PPIK', 'Januari s/d Desember 2023', 'Januari s/d Desember 2023', 'Belum dilaksanakan', 'Januari 2023', 'Pelaksanaan peremajaan data secara mandiri belum optimal.', 'Kualitas data ASN di lingkungan Kabupaten Lamongan menjadi kurang optimal', '-', '2022-12-13 20:30:02', '2023-03-28 00:10:05'),
