(233, 16, NULL, 'Presentase Fasyankes sesuai standart akreditasi', NULL, 'Pelayanan kesehatan  SPM bidang Kesehatan belum maksimal', 'RSO.23.01.13.02', 'Kepala Dinas Kesehatan', '[\"Ibu hamil tidak melakukan ANC terpadu\",\"Penduduk miskin yang tidak punya jaminan kesehatan\",\"Ketersedian data dan informasi tentang jumlah bayi balita yang mengalami gizi buruk belum optimal\",\"Angka penyakit menular TBC dan HIV\",\"Imunisasi bayi dan balita yang tidak lengkap\",\"Penderita penyakit tidak menular Hipertensi dan Diabetes tidak terkontol\",\"Konsumsi FE pada remaja putri yang tidak optimal\",\"Pelaksanaan Reakreditasi\"]', 'Internal dan external', 'C', '[\"Masih adanya angka kematian ibu dan bayi\",\"Adanya Kasus PD3I\",\"Balita Gizi Buruk \\/ stunting\",\"Angka kematian pada komplikasi Diabet dan Hipertensi\",\"Masyarakat miskin penderita penyakit kronis tidak berobat ke faskes\",\"Anemia pada remaja putri\",\"Putus obat pada penderita TB dan HIV\",\"Reakreditasi yang tidak terlaksana dapat menurunkan  mutu layanan puskesmas\"]', 'Masyarakat pengguna Layanan', '10', '10', '{\"dampak\":2.823529411764706,\"kemungkinan\":2.7058823529411766,\"skala_risiko\":7.640138408304499}', '1.Penetapan Target sasaran yang valid \r\n2.SOP pelayanan 3.jadwal kegiatan  dan laporan 4.monitoring tribulanan capaian spm  dan evaluasi', 'Koordinasi lintas program  dan lintas bidang', '1.Pemberian PMT  balita Gizi buruk\r\n2.Aksi bergizi melalui inovasi Ferameg(fe hari rabu pada remaja putri)\r\n3.Pemanatuan EPBGGM 4.Melaksankan On Job Training pada Nakes 5.Memberikan jaminan kesehatan masyarakat melalaui LASERKU  6.Pemantauan  PD3I  melalui aplikasi ASIK\r\n7.Posbindu PTM skrining pada penderita DM dan HT pemantauan pelaporan\r\n8.Pelaksanaan Reakreditasi Puskesmas', 'Kepala Dinas Kesehatan', '1.tb 2 .3\r\n2.tb 1\r\n3.tb 3\r\n4.tb 2\r\n5.tb 1.2.3.4\r\n6.tb 1.2.3.4\r\n7.tb 1.2.3.4\r\n8.tb.3.4', '1.pelaporan hasil kegiatan dan pemantauan 2.Laporan hasil kegiatan\r\n3.Aplikasi EPBGGM\r\n4.Lapo