(245, 10, NULL, 'Indeks Layanan Lalu Lintas Angkutan Jalan', NULL, 'terdapat sarana prasarana perhubungan yang belum menunjang kelancaran dan keselamatan pengguna jalan', 'RS0.23.15.27.01', 'Dinas Perhubungan', '[\"1. Fasilitas perlengkapan jalan yang kurang memadai dikarenakan rusak\\/aus habis umur ekonomisnya 2.  Faktor cuaca dan kondisi arus lalu lintas yang mempengaruhi kondisi perlengkapan jalan\"]', 'Internal/Eksternal', 'C', '[\"Munculnya potensi kemacetan dan kecelakaan lalu lintas\"]', 'Pengguna sarana prasarana lalu lintas', '79', '79', '{\"dampak\":4.264705882352941,\"kemungkinan\":3.6470588235294117,\"skala_risiko\":15.55363321799308}', 'Dilakukan survey ke lokasi untuk menentukan ruas jalan memiliki kelengkapan jalan yang sesuai', 'Banyaknya personel tidak berbanding lurus dengan banyaknya ruas jalan yang belum memiliki sarana prasarana kelancaran dan keselamatan jalan. Sehingga banyak ruas jalan yang belum memadai dapat dijangkau oleh Dishub', 'Peningkatan sarana prasarana pada ruas jalan yang membutuhkan penanganan prioritas', 'Kabid Sarana dan Prasarana', '3 Bulan', 'Dipasangnya rambu lalu lintas pada ruas jalan yang membutuhkan', 'Dinas Perhubungan', 'Masyarakat', '3 Bulan', '3 Bulan', '-', 'Melakukan survey rambu dan marka secara berkala', 'Kabid Sarana dan Prasarana', '3 Bulan', '3 Bulan', '-', 'Februari 2023', 'Minimalnya Anggaran sehingga banyak ruas jalan yang belum memadai', 'Kenyamanan dan Keselamatan Pengguna Jalan terganggu', '-', '2023-03-12 20:34:53', '2023-07-10 00:01:28'),
(246, 10, NULL, 'Persentase Peningkatan penyelenggaraan lalu lintas dan angkutan jalan (LLAJ) yang berkualitas', NULL, '1. Adanya kemacetan dan antrian panjang kendaraan 2.Masih tingginya angka kecelakaan lalu lintas dan kurangnya kesadaran pengguna jalan terhadap keselamatan berlalu lintas', 'RSO.23.15.27.02', 'Dinas Perhubungan', '[\"Orientasi Perilaku pengguna jalan yang tidak berkeselamatan dan melanggar\"]', 'Internal/Eksternal', 'C', '[\"Meningkatnya angka kecelakaan lalu lintas dan daerah rawan kecelakaan\"]', 'Masyarakat/Pemerintah', '79', '79', '{\"dampak\":3.2058823529411766,\"kemungkinan\":3.4411764705882355,\"skala_risiko\":11.032006920415226}', '1. Diturunkan personel Dishub untuk membantu mengurai tingkat kemacetan kendaraan\r\n2. Sosialisasi yang dilakukan kepada masyarakat akan pentingnya keselamatan berlalu lintas', 'Pengalihan arus kemacetan dan sosialisasi akan pentingnya keselamatan berlalu lintas, tidak diimbangi dengan kemampuan sarana prasarana jalan yang mumpuni, dengan pertumbuhan angka kendaraan yang semakin tinggi setiap tahun sehingga masih sering terjadi kemacetan', 'Manajemen rekayasa lalu lintas', 'Kabid Lalu Lintas dan Keselamatan', '1 Bulan', 'Adanya tim yang melakukan rekayasa lalu lintas pada saat terjadi kemacetan', 'Dinas Perhubungan', 'Masyarakat', '1 Bulan', '1 Bulan', '-', 'Mengurai kemacetan dan melaksanakan rekayasa lalu lintas', 'Kabid Lalu Lintas dan Keselamatan', '1 Bulan', '1 Bulan', '-', 'Maret 2023', '1. Banyaknya jalan yang masih berlubang, dan terdapat proyek perbaikan yang masih memakan badan jalan\r\n2. Masih kurangnya kesadaran pengguna jalan terhadap keselamatan berlalu lintas', 'Terjadi kemacetan di beberapa ruas jalan, dan laka yang menyebabkan kerugian materiil maupun korban jiwa', '-', '2023-03-12 20:37:24', '2023-07-10 00:01:28'),
(247, 10, NULL, 'Persentase sarana prasarana perhubungan yang berfungsi', NULL, 'Belum maksimalnya penyelenggaraan LLAJ', 'RSO.23.15.27.03', 'Dinas Perhubungan', '[\"Sinergitas Kegiatan dengan melibatkan semua stakeholder\"]', 'Internal/Eksternal', 'C', '[\"Tidak tercapainya Norma, standar, prosedur dan kriteria\"]', 'Masyarakat/Pemerintah', '79', '79', '{\"dampak\":2.7058823529411766,\"kemungkinan\":3.5588235294117645,\"skala_risiko\":9.629757785467127}', 'Memanfaatkan penggunaan sosial media sebagai salah satu alat untuk membantu penyelenggaraan LLAJ', 'Penggunaan sosial media masih belum menyentuh berbagai kalangan sebagai pengguna jalan, pemasangan rambu yang belum efektif merupakan salah satu alasan kurang maksimalnya penyelenggaraan LLAJ', 'Perawatan dan pemasangan rambu pada ruas yang memiliki potensi kemacetan dan rawan kecelakaan lalu lintas', 'Kabid Lalu Lintas dan Keselamatan', '3 Bulan', 'Memperbaiki rambu pada lokasi rawan kecelakaan/lokasi rawan macet dan pemasangan rambu pada ruas jalan yang belum terdapat rambu pada ruas jalan yang sering terjadi kemacetan maupun kecelakaan', 'Dinas Perhubungan', 'Masyarakat', '3 Bulan', '3 Bulan', '-', 'Melakukan survey rambu pada ruas jalan yang memiliki potensi kemacetan dan rawan kecelakaan', 'Kabid Sarana dan Prasarana', '3 Bulan', '3 Bulan', '-', 'Januari 2023', 'Minimalnya anggaran dan kurangnya tenaga tekhnis lapangan, untuk pemasangan rambu dan pengaturan lalu lintas pada ruas yang memiliki potensi kemacetan dan rawan kecelakaan', 'Penyelenggaraan Lalu Lintas Angkutan Jalan terganggu', '-', '2023-03-12 20:39:02', '2023-07-10 00:01:28'),
