(496, 19, NULL, 'Indeks Sistem Merit', NULL, 'Terdapat kesenjangan kompetensi dan kinerja', 'RSO 23.38.5.02', 'Kepala BKPSDM', '[\"Pengembangan kompetensi belum dilaksanakan terhadap seluruh pegawai dan belum tersusunnya Analisis kesenjangan kompetensi serta kinerja secara optimal.\"]', 'Internal', 'C', '[\"Rendahnya profesionalitas dan produktivitas kinerja ASN.\"]', 'Perangkat Daerah, ASN dan masyarakat', '44', '44', '{\"dampak\":3.5,\"kemungkinan\":3.9285714285714284,\"skala_risiko\":13.75}', '1). Perencanaan dan penyelenggaraan diklat ASN berdasarkan Analisis Kebutuhan Diklat;\r\n2). Rekonsiliasi data sertifikat pengembangan kompetensi ASN semesteran kepada seluruh OPD sebagai bahan dasar perencanaan diklat;\r\n3). Penerbitan Keputusan Tugas Belajar ASN;\r\n4). Pemberian bantuan biaya Tugas Belajar ASN;\r\n5). Melaksanakan analisis kinerja pada sebagian pegawai;\r\n6). Melaksanakan mentoring antara atasan langsung dan bawahan namun belum terdokumentasikan dan terjadwal secara berkala;\r\n7). Telah disediakan fitur dialog kinerja pada aplikasi E-performance namun pelaksanaannya belum terstruktur dan terjadwal secara berkala;\r\n8). Melaksanakan rapat untuk monev atas pelaksanaan strategi kinerja.', '1). Perencanaan dan penyelenggaraan diklat belum menggambarkan kebutuhan yang sebenarnya;\r\n2). Pengembangan kompetensi belum dilaksanakan pada seluruh pegawai;\r\n3). Data pengembangan kompetensi ASN belum terintegrasi dengan SIMPEG BKPSDM;\r\n4). Belum melaksanakan analisis kinerja pada seluruh pegawai.', '1). Rekonsiliasi data kediklatan  ASN pada seluruh OPD sebagai salah satu dasar pertimbangan penentuan peserta diklat;\r\n2). Monitoring dan evaluasi pelaksanaan pengembangan kompetensi pada seluruh OPD;\r\n3). Evaluasi dan rekonsiliasi data sertifikat pengembangan kompetensi ASN setiap tribulan pada seluruh OPD;\r\n4). Penerbitan sertifikat bagi ASN yang mengikuti kegiatan yang berkaitan dengan pengembangan kompetensi; \r\n5). Penambahan jumlah peserta diklat kepemimpinan, teknis dan fungsional;\r\n6). Melaksanakan analisis kinerja pegawai melalui aplikasi E-Performance.\r\n7). Melaksanakan evaluasi atas dokumen penilaian kinerja pegawai.\r\n8). Melaksanakan dialog kinerja secara terstruktur dan terjadwal secara berkala pada aplikasi E-performance.\r\n9). Melaksanakan mentoring antara atasan langsung dan bawahan serta terdokumentasikan dan terjadwal secara berkala.\r\n10). Melaksanakan rapat untuk monev atas pelaksanaan strategi kinerja tribulanan.\r\n11). Melaksanakan program pemberian penghargaan melalui kompetisi.\r\n12). Menyediakan API untuk mengintegrasikan aplikasi E-Performance dan SIMEGILAN.', 'Kepala BKPSDM', '12 bulan', '1) Rapat koordinasi rekon data diklat ASN', 'BKPSDM', 'Perangkat Daerah', 'Tribulan I s/d IV 2023', 'Tribulan I s/d IV 2023', 'Belum dilaksanakan', '1). Reviu hasil rekon data kediklatan;\r\n2). Laporan rekapitulasi penerbitan sertifikat; pengembangan kompetensi;\r\n3) Reviu dokumen perencanaan diklat;\r\n4). Reviu dokumen analisis kinerja;\r\n5). Reviu evaluasi dokumen penilaian kinerja;\r\n6). Reviu dokumen', 'Kepala BKPSDM', 'Januari s/d Desember 2023', 'Januari s/d Desember 2023', 'Belum dilaksanakan', 'Januari 2023', 'Belum semua pegawai mendapat pengembangan kompetensi ASN.\r\nPenempatan ASN belum sepenuhnya sesuai dengan kualifikasi dan kompetensi yang dimiliki.', 'Rendahnya profesionalitas dan produktivitas kinerja ASN.', '-', '2023-03-19 19:08:44', '2023-03-28 00:10:04'),
(497, 19, NULL, 'Indeks Sistem Merit', NULL, 'Sistem informasi yang ada belum berjalan secara optimal', 'RSO 23.38.5.03', 'Kepala BKPSDM', '[\"Sistem informasi yang belum terintegrasi pada proses kepegawaian lainnya\"]', 'Internal/ Eksternal', 'C', '[\"Pelayanan kepegawaian menjadi tidak efektif dan efisien\"]', 'Perangkat Daerah, ASN dan masyarakat', '44', '44', '{\"dampak\":3.5,\"kemungkinan\":3.4642857142857144,\"skala_risiko\":12.125}', 'Pengembangan fitur layanan kepegawaian setiap tahun secara bertahap.', '1). Fitur yang ada belum mengakomodir seluruh layanan kepegawaian;\r\n2). Aplikasi SIMPEG belum terintegrasi dengan sistem aplikasi lainnya.', '1). Penambahan fitur Usul KP PNS Online, fitur rencana Mutasi/ Promosi Jabatan;\r\n2). Integrasi SAPK/ SI-ASN dengan Si-Megilan.', 'Kepala BKPSDM', '12 bulan', 'Aplikasi SIMEGILAN', 'Bidang PPIK', 'Seluruh Bidang BKPSDM', 'Tribulan I s/d IV 2023', 'Tribulan I s/d IV 2023', 'Belum dilaksanakan', 'Pengujian fitur SIMPEG baru', 'Kepala BKPSDM', 'Januari s/d Desember 2023', 'Januari s/d Desember 2023', 'Belum dilaksanakan', 'Januari 2023', 'Belum tercukupinya alokasi anggaran untuk integrasi dan pengembangan fitur.\r\nBelum terintegrasinya SIMPEG dengan aplikasi layanan kepegawaian lainnya;\r\nBelum tersedianya semua fitur layanan kepegawaian;', 'Pelayanan kepegawaian menjadi tidak efektif dan efisien', '-', '2023-03-19 19:09:53', '2023-03-28 00:10:04'),
