(1037, 377, NULL, 'Indeks Sistem Merit', NULL, 'Manajemen karier balum mengacu pada talent pool dan rencana suksesi (manajemen talenta)', 'RSO.23.38.5.01', 'Kepala BKPSDM', '[\"Belum terlaksananya uji kompetensi terhadap seluruh pegawai\"]', 'Eksternal', 'C', '[\"Tidak ada jaminan kepastian karier yang jelas dan ASN tidak profesional dalam menjalankan tugas\"]', 'Perangkat Daerah, ASN dan masyarakat', '44', '44', '{\"dampak\":0,\"kemungkinan\":0,\"skala_risiko\":0}', '1). Melaksanakan uji kompetensi bagi sebagian ASN pejabat administrator secara bertahap setiap tahun;\r\n2) Penyusunan Raperbup tentang proses pengisian jabatan pimpinan tinggi secara terbuka dan kompetitif;\r\n3). Penilaian kelayakan oleh Tim Penilai Kinerja.', '1). Uji kompetensi hanya dilakukan pada sebagian pegawai;\r\n2). Belum dilaksanakan forum konsultasi publik;\r\n3). Uji kelayakan belum dapat sepenuhnya merepresentasikan potensi dan kompetensi ASN.', '1). Melaksanakan uji kompetensi dan menyusun talent pool ASN secara bertahap;\r\n2). Penetapan Raperbup tentang proses pengisian jabatan pimpinan tinggi secara terbuka dan kompetitif;\r\n3) Penyusunan Rancangan Perbup. tentang Mekanisme Mutasi dan Promosi\r\n4).Penilaian kelayakan oleh Tim Penilai Kinerja dengan mempertimbangkan kinerja dan hasil uji kompetensi.', 'Kepala BKPSDM', '12 bulan', '1). Uji kompetensi melalui assesment center yang terakreditasi;\r\n2). Form Performance Appraisial 360 derajat;\r\n3). Forum konsultasi publik;\r\n4). Berita Acara Tim Penilai Kinerja.', 'BKPSDM', 'Perangkat Daerah dan ASN Pemkab. Lamongan', '1). Tribulan I dan III 2023;\r\n3). Tribulan II 2023;\r\n4). Januari s.d Desember 2023.', '1). Tribulan I dan III 2023;\r\n3). Tribulan II 2023;\r\n4). Januari s.d Desember 2023.', 'Belum dilaksanakan', '1). Observasi dan reviu hasil uji kompetensi;\r\n2). Laporan hasil forum konsultasi publik;\r\n3). Reviu kinerja.', 'Kepala BKPSDM', '1) Tribulan III\r\n2) Tribulan II\r\n3) Tribulan II\r\n4) Tribulan II', '1) Tribulan III\r\n2) Tribulan II\r\n3) Tribulan II\r\n4) Tribulan II', 'Belum dilaksanakan', 'Oktober 2022', 'Tidak terpenuhinya kebutuhan alokasi anggaran untuk uji kompetensi terhadap seluruh pegawai;\r\nTidak terlaksananya uji kompetensi terhadap seluruh pegawai', 'Tidak ada jaminan kepastian karier yang jelas dan ASN tidak profesional dalam menjalankan tugas', '-', '2023-08-10 20:19:44', '2023-08-13 22:41:04'),
(1038, 377, NULL, 'Indeks Sistem Merit', NULL, 'Terdapat kesenjangan kompetensi dan kinerja', 'RSO.23.38.5.02', 'Kepala BKPSDM', '[\"Pengembangan kompetensi belum dilaksanakan terhadap seluruh pegawai dan belum tersusunnya analisis kesenjangan kompetensi serta kinerja secara optimal\"]', 'Internal', 'C', '[\"Rendahnya profesionalitas dan produkvitas kinerja ASN\"]', 'Perangkat Daerah, ASN dan masyarakat', '44', '44', '{\"dampak\":0,\"kemungkinan\":0,\"skala_risiko\":0}', '1). Perencanaan dan penyelenggaraan diklat ASN berdasarkan Analisis Kebutuhan Diklat;\r\n2). Rekonsiliasi data sertifikat pengembangan kompetensi ASN semesteran kepada seluruh OPD sebagai bahan dasar perencanaan diklat;\r\n3). Penerbitan Keputusan Tugas Belajar ASN;\r\n4). Pemberian bantuan biaya Tugas Belajar ASN;\r\n5). Melaksanakan analisis kinerja pada sebagian pegawai;\r\n6). Melaksanakan mentoring antara atasan langsung dan bawahan namun belum terdokumentasikan dan terjadwal secara berkala;\r\n7). Telah disediakan fitur dialog kinerja pada aplikasi E-performance namun pelaksanaannya belum terstruktur dan terjadwal secara berkala;\r\n8). Melaksanakan rapat untuk monev atas pelaksanaan strategi kinerja.', '1). Perencanaan dan penyelenggaraan diklat belum menggambarkan kebutuhan yang sebenarnya;\r\n2). Pengembangan kompetensi belum dilaksanakan pada seluruh pegawai;\r\n3). Data pengembangan kompetensi ASN belum terintegrasi dengan SIMPEG BKPSDM;\r\n4). Belum melaksanakan analisis kinerja pada seluruh pegawai.', '1). Menyusun analisis kesenjangan kompetensi ASN dan strategi untuk mengatasinya\r\n2). Melaksanakan evaluasi atas dokumen penilaian kinerja pegawai;\r\n3). Melaksanakan analisis kesenjangan kinerja pegawai melalui aplikasi E-Performance;\r\n4). Melaksanakan monev dialog kinerja secara berkala melalui aplikasi E-performance;\r\n5). Melaksanakan program pemberian penghargaan melalui kompetisi;\r\n6). Menyediakan API untuk mengintegrasikan aplikasi E-Performance dan SIMEGILAN.', 'Kepala BKPSDM', '12 bulan', '1) Rapat koordinasi rekon data diklat ASN;\r\n2). Surat Edaran himbauan pada OPD untuk menerbitkan sertifikat pengembangan kompetensi;\r\n3). Dokumen perencanaan diklat.\r\n4). Aplikasi E-Performance\r\n5). Dokumen penilaian prestasi kerja;\r\n6). Dokumentasi', 'BKPSDM', 'Perangkat Daerah dan ASN Pemkab. Lamongan', 'Tribulan I s/d IV 2023', 'Tribulan I s/d IV 2023', 'Belum dilaksanakan', '1). Reviu hasil rekon data kediklatan;\r\n2) Laporan rekapitulasi penerbitan sertifikat; pengembangan kompetensi;\r\n3) Reviu dokumen perencanaan diklat;\r\n4). Reviu dokumen analisis kinerja;\r\n5). Reviu evaluasi dokumen penilaian kinerja;\r\n6). Reviu dokumen', 'Kepala BKPSDM', '1) Tribulan II\r\n2) Tribulan I\r\n3) Januari s.d Desember\r\n4) Tribulan IV\r\n5) Tribulan IV\r\n6) Tribulan I', '1) Tribulan II\r\n2) Tribulan I\r\n3) Januari s.d Desember\r\n4) Tribulan IV\r\n5) Tribulan IV\r\n6) Tribulan I', 'Belum dilaksanakan', 'Januari 2023', 'Belum semua pegawai mendapat pengembangan kompetensi ASN.\r\nPenempatan ASN belum sepenuhnya sesuai dengan kualifikasi dan kompetensi yang dimiliki.', 'Rendahnya profesionalitas dan produktivitas kinerja ASN.', '-', '2023-08-10 20:21:48', '2023-08-13 22:38:35'),
(1039, 377, NULL, 'Indeks Sistem Merit', NULL, 'Sistem informasi yang ada belum berjalan secara optimal', 'RSO.23.38.5.03', 'Kepala BKPSDM', '[\"Sistem informasi yang belum terintegrasi pada proses kepegawaian lainnya\"]', 'Internal/ Eksternal', 'C', '[\"Pelayanan kepegawaian menjadi tidak efektif dan efisien\"]', 'Perangkat Daerah, ASN dan masyarakat', '44', '44', '{\"dampak\":0,\"kemungkinan\":0,\"skala_risiko\":0}', 'Pengembangan fitur layanan kepegawaian setiap tahun secara bertahap.', '1). Fitur yang ada belum mengakomodir seluruh layanan kepegawaian;\r\n2). Aplikasi SIMPEG belum terintegrasi dengan sistem aplikasi lainnya.', '1). Pengembangan fitur KP dan Kenaikan jenjang Jabatan Fungsional secara elektronik\r\n2). Integrasi SAPK/ SI-ASN dengan Si-Megilan.', 'Kepala BKPSDM', '12 bulan', 'Aplikasi SIMEGILAN', 'Bidang Pengadaan, Pemberhentian dan Informasi Kepegawaian Aparatur', 'Seluruh Bidang BKPSDM', 'Tribulan I s/d IV 2023', 'Tribulan I s/d IV 2023', 'Belum dilaksanakan', 'Pengujian fitur SIMPEG baru', 'Kepala BKPSDM', '1) Tribulan IV\r\n2) Tribulan I', '1) Tribulan IV\r\n2) Tribulan I', 'Belum dilaksanakan', 'Januari 2023', 'Belum tercukupinya alokasi anggaran untuk integrasi dan pengembangan fitur.\r\nBelum terintegrasinya SIMPEG dengan aplikasi layanan kepegawaian lainnya;\r\nBelum tersedianya semua fitur layanan kepegawaian;', 'Pelayanan kepegawaian menjadi tidak efektif dan efisien', '-', '2023-08-10 20:23:18', '2023-08-13 22:38:35'),
