(1226, 20, 'Penyediaan Jasa Penunjang Urusan Pemerintahan Daerah', 'Prosentase pelayanan administrasi perkantoran yang baik', 'Identifikasi risiko, Analisis risiko, Evaluasi risiko, Pengembangan strategi mitigasi, dan Implementasi dan monitoring', 'Banyak deadline tetapi fasilitas kantor kurang memadai; Terhambatnya jasa asuransi dan kesehatan', 'RSO.23.03.4.19', 'Dinas PU Bina Marga', '[\"Kurangnya bahan cetakan dan sarana prasarana kantor\",\"Banyak pegawai tidak dibackup BPJS\"]', 'Internal', 'C', '[\"Pegawai tidak dapat menyelesaikan  pekerjaan tepat waktu\",\"Jika terjadi kecelakaan pada pegawai tidak dapat potongan dana dari BPJS\"]', 'Dinas PU Bina Marga dan Pegawai', '34', '34', NULL, 'Membuat usulan anggran yang tepat dan melakukan monitoring secara ketat', 'Ketidakmampuan untuk merencanakan dan mengalokasikan anggaran dengan akurat, serta kesulitan dalam memantau dan mengontrol pengeluaran selama pelaksanaan proyek atau kegiatan', 'Melaksanakan Pemutakhitan data jalan dan Jembatan', 'Kasubag Umum', '12 Bulan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2023-08-22 01:27:32', '2023-08-28 07:09:54'),
(1227, 20, 'Pemeliharaan Barang Milik Daerah Penunjang Urusan Pemerintah Daerah', 'Prosentase unit kerja penunjang urusan pemerintah yang terlayani dengan baik', 'Identifikasi risiko, Analisis risiko, Evaluasi risiko, Pengembangan strategi mitigasi, dan Implementasi dan monitoring', 'Mobil jabatan tidak terpelihara dengan baik;  Kendaraan dinas mengalami telat pajak', 'RSO.23.03.4.19', 'Dinas PU Bina Marga', '[\"pemakaian dengan intensitas tinggi\",\"kurang cermatnya memonitoring pajak kendaraan\"]', 'Internal dan eksternal', 'C', '[\"Pegawai tidak dapat menggunakan kendaraan tersebut diarea rawat operasi satlantas\",\"Kegiatan dilapangan menjadi terhambat\"]', 'Dinas PU Bina Marga', '34', '34', NULL, 'Melakukan pemeliharaan dan mengecek secara berkala kondisi kendaraan serta pajak-pajak kendaraan', 'Sering lalai dan banyak kendaraan yang harus didaftarkan pajaknya secara bersamaan', 'Melakukan monitoring dan service secara rutin\r\ndan Setiap tahun dianggarkan dana untuk kendaraan', 'Kasubag Umum', '12 Bulan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2023-08-22 01:30:58', '2023-08-28 07:09:54'),
(1228, 20, 'Sub Kegiatan Pengelolaan Leger Jalan', 'Kurangnya pemutakhiran data Jalan', 'Identifikasi risiko, Analisis risiko, Evaluasi risiko, Pengembangan strategi mitigasi, dan Implementasi dan monitoring', 'Kurangnya pemutakhiran data jalan yang belum terealisasi', 'RSO.23.03.4.19', 'Dinas PU Bina Marga dan Sub Koordinator Kegiatan Pengelolaan Leger Jalan', '[\"Pembaruan data jalan yang selalu terjadi perubahan setiap tahunnya\"]', 'Internal dan eksternal', 'C', '[\"Kurangnya pemutakhiran data jalan yang selalu ada perubahan setiap tahun\"]', 'Dinas PU Bina Marga', '34', '34', NULL, 'Melaksanakan Pemutakhitan data jalan dan Jembatan secara berkala', 'Kurangnya pemutakhiran data jalan yang selalu ada perubahan setiap tahun', 'Melaksanakan Pemutakhitan data jalan dan Jembatan', 'Kabid Sarana dan Prasarana Kebinamargaan dan Kabid Pengelolaan Jalan', '12 Bulan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2023-08-22 01:33:41', '2023-08-28 07:09:54'),
(1229, 20, 'Survey Kondisi Jalan/Jembatan', 'Jumlah Dokumen Survey Kondisi Jalan dan Jembatan', 'Identifikasi risiko, Analisis risiko, Evaluasi risiko, Pengembangan strategi mitigasi, dan Implementasi dan monitoring', '1. Terjadinya pembuatan data ulang  bila ada perubahan dan kekeliruan pada saat cek langsung di lapangan dan juga titik koordinat yang  tidak tepat.; 2. Terjadinya kecelakaan kerja saat pekerjaan pemotongan pohon dan kurangnya keamanan alat perlindungan diri atau hal lain di luar teknis.; 3. Kurangnya koordinasi antara pelapor dan tim yang mengakibatkan tidak tepatnya penanganan di lapangan.', 'RS0.23.03.4.19', 'Dinas PU Bina Marga', '[\"Kurangnya koordinasi antara pihak di lapangan dan data yang akan di kerjakan.\",\"Perlu sosialisasi dan diberikan kepada pemakai alat potong tentang sebuah wawasan terkait pentingnya keselamatan kerja\",\"Menekankan koordinasi yang dapat dipertanggung jawabkan dari pihak pelapor\"]', 'internal dan eksternal', 'C', '[\"Kurangnya koordinasi antara pihak di lapangan dan data yang akan di kerjakan.\",\"Perlu sosialisasi dan diberikan kepada pemakai alat potong tentang sebuah wawasan terkait pentingnya keselamatan kerja\",\"Menekankan koordinasi yang dapat dipertanggung jawabkan dari pihak pelapor\"]', 'Dinas PU Bina Marga', '34', '34', NULL, 'Memilah data jalan dan jambatan yang akan diperbarui datanya', 'Banyaknya simpul ruas dan kurangnya anggaran', 'Memperbarui dan memilah data jalan dan jembatan yang akan diperbarui datanya', 'Kabid Sarana dan Prasarana Kebinamargaan dan Kabid Pengelolaan Jalan', '12 Bulan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2023-08-23 21:31:41', '2023-08-28 07:09:54'),
(1230, 20, 'Rekonstruksi Jalan', 'Panjang Jalan Kabupaten yang dilebarkan', 'Identifikasi risiko, Analisis risiko, Evaluasi risiko, Pengembangan strategi mitigasi, dan Implementasi dan monitoring', '1. Terlambatnya Penyusunan Perencanaan Kegiatan; 2. Kurangnya Kemampuan Keuangan (Financial) atau Modal dari Pemenang lelang.; 3. Harga penawaran dari penyedia jasa sebagai pemenang lelang turun cukup jauh dibawah harga pasar.; 4. Jalan yang sudah dibangun rusak karena struktur tanah; 5. terjadinya kecelakaan kerja dalam pelaksanaan rekonstruksi jalan; 6. bencana alam yang dapat merusak jalan yang sedang/ sudah direkonstruksi', 'RS0.23.03.4.19', 'Dinas PU Bina Marga', '[\"Penyusunan yang terlambat akibat adanya perubahan - perubahan yang terjadi mengikuti kondisi terbaru di lapangan.\",\"Tidak terpenuhinya persyaratan teknis lelang oleh peserta lelang.\",\"Banyaknya usaha baru dalam bidang konstruksi karena kemudahan syarat dari peraturan perusahaan, sehingga terjadi persaingan harga penawaran dengan cara memberikan harga seminimal mungkin namun tetap dengan kualitas bahan sesuai spesifikasi yang telah ditentukan.\",\"Dalam proses pelaksanaan rekonstruksi jalan terdapat analisa jenis struktur yang dilakukan pada saat kegiatan survey oleh pihak penyedia. jenis tanah dan struktur tanah harus diidentifikasi dengan baik agar dapat ditentukan teknik apa yang harus dilakukan dalam pelaksanaan rekonstrtuksi jalan.\",\"Gagal menjaga keselamatan dalam pelaksanaan rekonstruksi jalan karena tidak mematuhi peraturan keselamatan kerja yang sudah diatur di dalam kerangka acuan kerja\",\"bencana alam dapat terjadi karena indonesia masuk kedalam daerah yang rawan terjadi bencana alam seperti gempa bumi, gunung meletus, tanah longsor, dll\"]', 'internal dan eksternal', 'C', '[\"Terlambatnya pelaksanaan lelang dan fisik kegiatan\",\"Terjadinya Gagal Lelang atau Lelang Ulang\",\"Mutu pekerjaan kurang memenuhi syarat sehingga mengakibatkan adanya resiko temuan dari pemeriksa keuangan dan aparat penegak hukum.\",\"Kesalahan dalam melakukan analisa struktur tanah dapat berakibat pada rusak\\/ longsornya jalan karena struktur tanah yang tidak mendukung.\",\"terjadinya kecelakaan kerja yang dapat mengakibatkan pekerja mengalami luka atau dirawat di rumah sakit\",\"bencana alam dapat mengakibatkan rusaknya jalan yang sudah direkonstruksi, dan juga dapat merubah struktur tanah\"]', 'PPK, PPTK, Kontraktor, Konsultan perencana, Konsultan Pengawas', '34', '34', NULL, 'Memperbarui dan memilah data jalan dan jembatan yang akan diperbarui datanya, Memilah data jalan dan jembatan yang akan diperbarui datanya, Pihak Bagian Pengadaan Barang Jasa agar lebih selektif dan mencermati pengalaman kerja (Referensi Kerja) dari peserta lelang yang akan ditetapkan sebagai pemenang lelang, Melakukan perencanaan T-1 dan menyiapkan bahan untuk lelang pada awal tahun serta mempercepat proses perencanaan dan pengiriman dokumen lelang ke Bagian Pengadaan Barang Jasa, Memperketat sistem pemeriksaan berkas penawaran dan lebih selektif dalam penentuan pemenang lelang oleh Bagian Pengadaan Barang Jasa mempertimbangkan rekam jejak pekerjaan setiap peserta lelang, dilakukan analisa secara teliti dan menyeluruh dengan didampingi oleh pihak dinas yang lebih paham dengan jenis tanah yang terdapat di lokasi tertentu sehingga tidak terjadi kesalahan dalam melakukan pelaksaan kegiatan rekonstruksi jalan, dilakukan pengecekan secara rutin oleh penyedia, konsultan pengawas dan juga dari pihak dinas agar para pekerja selalu mengenakan APD dan pengaman dalam mengoperasikan alat berat selama pelaksanaan pekerjaan rekonstruksi jalan, dan memasang pendeteksi bencana alam sehingga dapat dilakukan langkah antisipasi dan juga strategi pengerjaan khusus apabila pengerjaan terjadi di area rawan bencana alam,', 'Adanya kelalaian dan kurangnya monitoring serta terjadinya bencana alam yang tidak diprediksi', 'Memperbarui dan memilah data jalan dan jembatan yang akan diperbarui datanya, Memilah data jalan dan jembatan yang akan diperbarui datanya, Pihak Bagian Pengadaan Barang Jasa agar lebih selektif dan mencermati pengalaman kerja (Referensi Kerja) dari peserta lelang yang akan ditetapkan sebagai pemenang lelang, Melakukan perencanaan T-1 dan menyiapkan bahan untuk lelang pada awal tahun serta mempercepat proses perencanaan dan pengiriman dokumen lelang ke Bagian Pengadaan Barang Jasa, Memperketat sistem pemeriksaan berkas penawaran dan lebih selektif dalam penentuan pemenang lelang oleh Bagian Pengadaan Barang Jasa mempertimbangkan rekam jejak pekerjaan setiap peserta lelang, dilakukan analisa secara teliti dan menyeluruh dengan didampingi oleh pihak dinas yang lebih paham dengan jenis tanah yang terdapat di lokasi tertentu sehingga tidak terjadi kesalahan dalam melakukan pelaksaan kegiatan rekonstruksi jalan, dilakukan pengecekan secara rutin oleh penyedia, konsultan pengawas dan juga dari pihak dinas agar para pekerja selalu mengenakan APD dan pengaman dalam mengoperasikan alat berat selama pelaksanaan pekerjaan rekonstruksi jalan, dan memasang pendeteksi bencana alam sehingga dapat dilakukan langkah antisipasi dan juga strategi pengerjaan khusus apabila pengerjaan terjadi di area rawan bencana alam,', 'Kabid Pengelolaan Jalan', '12 Bulan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2023-08-23 21:41:15', '2023-08-28 07:09:54');
INSERT INTO `kertas_kerjas` (`id`, `konteks_id`, `kegiatan`, `indikator_kinerja`, `risiko_tahap`, `risiko_uraian`, `risiko_kode`, `risiko_pemilik`, `sebab_uraian`, `sebab_sumber`, `c_or_uc`, `dampak_uraian`, `dampak_pihak_terkena`, `entitas_id`, `dinas_terkait_id`, `rata_rata`, `uraian_pengendalian`, `celah_pengendalian`, `rencana_pengendalian`, `penanggung_jawab`, `target_penyelesaian`, `media`, `penyedia_informasi`, `penerima_informasi`, `rencana_pelaksanaan`, `realisasi_pelaksanaan`, `keterangan`, `metode_pemantauan`, `penanggung_jawab_pemantauan`, `rencana_pelaksanaan_pemantauan`, `realisasi_pemantauan`, `keterangan_pemantauan`, `kejadian_tanggal`, `kejadian_sebab`, `kejadian_dampak`, `keterangan_kejadian`, `created_at`, `updated_at`) VALUES
(1231, 20, 'Pemeliharaan Berkala Jalan', 'Panjang Jalan Kabupaten yang ditingkatkan', 'Identifikasi risiko, Analisis risiko, Evaluasi risiko, Pengembangan strategi mitigasi, dan Implementasi dan monitoring', '1. Terlambatnya Penyusunan Perencanaan Kegiatan.; 2. Kurangnya Kemampuan Keuangan (Financial) atau Modal dari Pemenang lelang.; 3. Harga penawaran dari penyedia jasa sebagai pemenang lelang turun cukup jauh dibawah harga pasar.; 4. Jalan yang sudah dibangun rusak karena struktur tanah; 5. terjadinya kecelakaan kerja dalam pelaksanaan rekonstruksi jalan; 6. bencana alam yang dapat merusak jalan yang sedang/ sudah direkonstruksi', 'RS0.23.03.4.19', 'Dinas PU Bina Marga', '[\"Penyusunan yang terlambat akibat adanya perubahan - perubahan yang terjadi mengikuti kondisi terbaru di lapangan.\",\"Tidak terpenuhinya persyaratan teknis lelang oleh peserta lelang.\",\"Banyaknya usaha baru dalam bidang konstruksi karena kemudahan syarat dari peraturan perusahaan, sehingga terjadi persaingan harga penawaran dengan cara memberikan harga seminimal mungkin namun tetap dengan kualitas bahan sesuai spesifikasi yang telah ditentukan.\",\"Dalam proses pelaksanaan rekonstruksi jalan terdapat analisa jenis struktur yang dilakukan pada saat kegiatan survey oleh pihak penyedia. jenis tanah dan struktur tanah harus diidentifikasi dengan baik agar dapat ditentukan teknik apa yang harus dilakukan dalam pelaksanaan rekonstrtuksi jalan.\",\"Gagal menjaga keselamatan dalam pelaksanaan rekonstruksi jalan karena tidak mematuhi peraturan keselamatan kerja yang sudah diatur di dalam kerangka acuan kerja\",\"bencana alam dapat terjadi karena indonesia masuk kedalam daerah yang rawan terjadi bencana alam seperti gempa bumi, gunung meletus, tanah longsor, dll\"]', 'internal dan eksternal', 'C', '[\"Terlambatnya pelaksanaan lelang dan fisik kegiatan\",\"Terjadinya Gagal Lelang atau Lelang Ulang\",\"Mutu pekerjaan kurang memenuhi syarat sehingga mengakibatkan adanya resiko temuan dari pemeriksa keuangan dan aparat penegak hukum.\",\"Kesalahan dalam melakukan analisa struktur tanah dapat berakibat pada rusak\\/ longsornya jalan karena struktur tanah yang tidak mendukung.\",\"terjadinya kecelakaan kerja yang dapat mengakibatkan pekerja mengalami luka atau dirawat di rumah sakit\",\"bencana alam dapat mengakibatkan rusaknya jalan yang sudah direkonstruksi, dan juga dapat merubah struktur tanah\"]', 'PPK, PPTK, Kontraktor, Konsultan perencana, Konsultan Pengawas', '34', '34', NULL, '1. Pihak Bagian Pengadaan Barang Jasa agar lebih selektif dan mencermati pengalaman kerja (Referensi Kerja) dari peserta lelang yang akan ditetapkan sebagai pemenang lelang; 2. Melakukan perencanaan T-1 dan menyiapkan bahan untuk lelang pada awal tahun serta mempercepat proses perencanaan dan pengiriman dokumen lelang ke Bagian Pengadaan Barang dan Jasa; 3. Memperketat sistem pemeriksaan berkas penawaran dan lebih selektif dalam penentuan pemenang lelang oleh Bagian Pengadaan Barang dan Jasa mempertimbangkan rekam jejak pekerjaan setiap peserta lelang.\r\n; 4. dilakukan analisa secara teliti dan menyeluruh dengan didampingi oleh pihak dinas yang lebih paham dengan jenis tanah yang terdapat di lokasi tertentu sehingga tidak terjadi kesalahan dalam melakukan pelaksaan kegiatan rekonstruksi jalan\r\n; 5. dilakukan pengecekan secara rutin oleh penyedia, konsultan pengawas dan juga dari pihak dinas agar para pekerja selalu mengenakan APD dan pengaman dalam mengoperasikan alat berat selama pelaksanaan pekerjaan rekonstruksi jalan\r\n; 6. memasang pendeteksi bencana alam sehingga dapat dilakukan langkah antisipasi dan juga strategi pengerjaan khusus apabila pengerjaan terjadi di area rawan bencana alam', '1. akibat adanya perubahan - perubahan yang terjadi mengikuti kondisi terbaru di lapangan. 2. Pemenang lelang kurang anggaran karena kemudaan proses perizinan usaha konstruksi.', '1. Pihak Bagian Pengadaan Barang Jasa agar lebih selektif dan mencermati pengalaman kerja (Referensi Kerja) dari peserta lelang yang akan ditetapkan sebagai pemenang lelang; 2. Melakukan perencanaan T-1 dan menyiapkan bahan untuk lelang pada awal tahun serta mempercepat proses perencanaan dan pengiriman dokumen lelang ke Bagian Pengadaan Barang dan Jasa; 3. Memperketat sistem pemeriksaan berkas penawaran dan lebih selektif dalam penentuan pemenang lelang oleh Bagian Pengadaan Barang dan Jasa mempertimbangkan rekam jejak pekerjaan setiap peserta lelang.\r\n; 4. dilakukan analisa secara teliti dan menyeluruh dengan didampingi oleh pihak dinas yang lebih paham dengan jenis tanah yang terdapat di lokasi tertentu sehingga tidak terjadi kesalahan dalam melakukan pelaksaan kegiatan rekonstruksi jalan\r\n; 5. dilakukan pengecekan secara rutin oleh penyedia, konsultan pengawas dan juga dari pihak dinas agar para pekerja selalu mengenakan APD dan pengaman dalam mengoperasikan alat berat selama pelaksanaan pekerjaan rekonstruksi jalan\r\n; 6. memasang pendeteksi bencana alam sehingga dapat dilakukan langkah antisipasi dan juga strategi pengerjaan khusus apabila pengerjaan terjadi di area rawan bencana alam', 'Kepala Dinas', '12 Bulan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2023-08-23 21:45:01', '2023-08-28 07:09:54'),
(1232, 20, 'Pemeliharaan Rutin Jalan', 'Panjang Jalan Kabupaten yang direhabilitasi', 'Identifikasi risiko, Analisis risiko, Evaluasi risiko, Pengembangan strategi mitigasi, dan Implementasi dan monitoring', '1. Umur konstruksi infrastruktur jalan tidak sesuai dengan rencana; 2. Keterbatasan Kesiapan Batching Plant, AMP dan Penyedia Bahan Material; 3. Jalan yang sudah dibangun rusak karena struktur tanah; 4. terjadinya kecelakaan kerja dalam pelaksanaan rehabilitasi jalan; 5. bencana alam yang dapat merusak jalan yang sedang/ sudah direhabilitasi', 'RS0.23.03.4.19', 'Dinas PU Bina Marga', '[\"Jumlah kendaraan yang lewat dan MST melebihi dari perencanaan awal.\",\"Menekankan koordinasi yang dapat dipertanggung jawabkan dari pihak pelapor\",\"Dalam proses pelaksanaan rekonstruksi jalan terdapat analisa jenis struktur yang dilakukan pada saat kegiatan survey oleh pihak penyedia. jenis tanah dan struktur tanah harus diidentifikasi dengan baik agar dapat ditentukan teknik apa yang harus dilakukan dalam pelaksanaan rehabilitasi jalan.\",\"Gagal menjaga keselamatan dalam pelaksanaan rehabilitasi jalan karena tidak mematuhi peraturan keselamatan kerja yang sudah diatur di dalam kerangka acuan kerja\",\"bencana alam dapat terjadi karena indonesia masuk kedalam daerah yang rawan terjadi bencana alam seperti gempa bumi, gunung meletus, tanah longsor, dll\"]', 'internal dan eksternal', 'C', '[\"Infrastruktur Jalan yang dibangun lebih cepat terjadi kerusakan.\",\"Terlambatnya progres pekerjaan yang berdampak terganggunya aktivitas masyarakat\",\"Kesalahan dalam melakukan analisa struktur tanah dapat berakibat pada rusak\\/ longsornya jalan karena struktur tanah yang tidak mendukung.\",\"terjadinya kecelakaan kerja yang dapat mengakibatkan pekerja mengalami luka atau dirawat di rumah sakit\",\"bencana alam dapat mengakibatkan rusaknya jalan yang sudah direhabilitasi, dan juga dapat merubah struktur tanah\"]', 'PPK, PPTK, Kontraktor, Konsultan perencana, Konsultan Pengawas', '34', '34', NULL, 'Memperbarui metodologi konstruksi dan perencanaan untuk memastikan kesesuaian umur infrastruktur jalan dengan rencana yang diharapkan.\r\nDiversifikasi sumber penyediaan bahan, investasi dalam peralatan cadangan, dan kerjasama yang erat dengan pemasok untuk mengatasi keterbatasan dalam pemasokan material.\r\nMelakukan analisis teknis tanah sebelum pembangunan, serta penerapan teknik konstruksi yang sesuai dengan karakteristik tanah untuk mencegah kerusakan jalan.\r\nMenerapkan program pelatihan keselamatan kerja dan pengawasan yang ketat untuk mengurangi risiko kecelakaan selama proyek rehabilitasi jalan.\r\nMengintegrasikan analisis risiko bencana alam dalam perencanaan rehabilitasi jalan dan menerapkan desain tahan bencana untuk mengurangi dampak bencana terhadap jalan yang sedang atau sudah direhabilitasi.', '1. Kurangnya pemantauan dan pemeliharaan rutin selama konstruksi jalan menyebabkan infrastruktur tidak mencapai umur yang diinginkan; 2. Tidak adanya rencana mitigasi untuk mengatasi keterbatasan persediaan material dan fasilitas produksi dapat mempengaruhi kelancaran proyek; 3. Kekurangan analisis tanah yang mendalam dalam perencanaan dan desain mengakibatkan kerusakan jalan akibat perubahan struktur tanah yang tidak terduga.; 4. Kurangnya pelatihan dan pengawasan dalam aspek keselamatan kerja meningkatkan risiko kecelakaan pada proyek rehabilitasi jalan; 5. Tidak mempertimbangkan potensi bencana alam dalam perencanaan mengakibatkan kerusakan jalan akibat efek dari bencana tersebut.', '1. Perlunya pembatasan Klas Jalan; 2. Berkoordinasi dengan pelapor agar tidak terjadi kesalahan pemotongan pohon yang dilaporkan; 3. dilakukan analisa secara teliti dan menyeluruh dengan didampingi oleh pihak dinas yang lebih paham dengan jenis tanah yang terdapat di lokasi tertentu sehingga tidak terjadi kesalahan dalam melakukan pelaksaan kegiatan rehabilitasi jalan; 4. dilakukan pengecekan secara rutin oleh penyedia, konsultan pengawas dan juga dari pihak dinas agar para pekerja selalu mengenakan APD dan pengaman dalam mengoperasikan alat berat selama pelaksanaan pekerjaan rehabilitasi jalan\r\n; 5. memasang pendeteksi bencana alam sehingga dapat dilakukan langkah antisipasi dan juga strategi pengerjaan khusus apabila pengerjaan terjadi di area rawan bencana alam', 'Kepala Dinas', '12 Bulan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2023-08-23 21:48:45', '2023-08-28 07:09:54'),
(1234, 20, 'Penggantian Jembatan', 'Jumlah Jembatan Kabupaten yang Dibangun', 'Identifikasi risiko, Analisis risiko, Evaluasi risiko, Pengembangan strategi mitigasi, dan Implementasi dan monitoring', '1. Lahan tidak dapat digunakan karena perlu adanya relokasi penghuni dan prosesnya yang rumit; 2. Kesulitan pada kondisi lokasi yang tak terduga; 3. Resiko Struktur Tanah; 4. Keterbatasan ruang kerja /working space konstruksi; 5. Risiko Status Tanah; 6. Kontaminasi/polusi ke lingkungan lokasi; 7. \"Terganggunya kenyamanan masyarakat yang berada di sekitar area proyek; 8. Ketidakjelasan spesifikasi output; 9. Gagal menjaga keselamatan dalam lokasi; 10.. Kenaikan biaya konstruksi; 11. Kinerja kontraktor/subkontraktor yang buruk; 12. Kesalahan desain; 13. Terlambatnya penyelesaian konstruksi; 14. Buruk atau tidak tersedianya layanan; 15. Kegagalan manajemen proyek; 16. Kenaikan biaya energi–karena inefisiensi unit; 17. Kesalahan perhitungan penawaran; 18. konektivitas jaringan jalan dan transportasi; 19. Perubahan regulasi (dan pajak) yang umum; 20. Keterlambatan perolehan persetujuan perencanaan; 21. Bencana alam; 22. Force majeure politis; 23. Cuaca ekstrim;', 'RS0.23.03.4.19', 'Dinas PU Bina Marga', '[\"Pelaksanaan Pekerjaan Terhambat dan berakibat terlambatnya penyelesaian pekerjaan\",\"Mengakibatkan kegagalan struktur yang berakibat keterlambatan proyek\",\"Mengakibatkan kegagalan struktur yang berakibat keterlambatan proyek\",\"Kesulitan dalam menempatkan alat dan material yang berakibat terhambatnya pelaksaan pekerjaan\",\"terjadi sengketa yang mengakibatkan pekerjaan tidak dapat berjalan\",\"mengakibatkan pencemaran lingkungan sekitar\",\"proses mobilisasi alat dan material yang terganggu mengakibatkan pekerjaan terhambat\",\"mengakibatkan banyaknya perubahan perubahan baik anggaran hingga jenis material dan metode pengerjaan yang berakibat terlambatnya pekerjaan\",\"terjadinya kecelakaan kerja hingga rusaknya infrastruktur lainnya yang dapat berakibat terhambatnya pekerjaan\",\"mengakibatkan keterlambatan proyek karena pengurusan administrasii\",\"terjadi hambatan dalam pelaksanaan pekerjaan\",\"terjadinya kegagalan struktur yang berakibat terlambatnya pekerjaan\",\"terlambatnya penyelesainya pekerjaan\",\"tidak terkontrolnya kapasitas kendaraan yang melewati jembatan mengakibatkan overload pada struktur jembatan\",\"mengakibatkan keterlambatan pekerjaan\",\"terhambatanya penyelesaian pekerjaan\",\"mengakibatkan tidak selesainya pekerjaan\",\"terhambatnya pelaksanaan pekerjaan\",\"terhambatnya penyelelesaian pekerjaan\",\"menghambat pelaksanaan pekerjaan\",\"mengakibatan keterlambatan \\/ kegagalan pekerjaan\",\"terhambatnya penyelesaian pekerjaan\",\"Terjadinya keterlampatan \\/ kegagalan proyek\"]', 'internal dan eksternal', 'C', '[\"Kegagalan pembebasan lahan karena proses pembebasan lahan yang sulit, seperti tanah wakaf, Tanah Kas Desa (TKD), dan kehutanan yang membutuhkan waktu lama.\",\"\\\"Terjadinya longsoran tebing sungai di luar rencana Kondisi aliran sungai yang deras akibat curah hujan tinggi\\\"\",\"\\\"Lokasi proyek melewati daerah patahan, sehingga potensi terjadinya pergerakan lempeng yang mempengaruhi kualitas jembatan. Ketersediaan data tanah yang tidak memadai pada lokasi pilar yang akan dipertahankan.\\\"\",\"Lokasi proyek sangat sempit untuk operasional alat dan peletakan bahan\",\"kemungkinan kepemilikan sertifikat tanah ganda ditemukan saat proses pembebasan lahan\",\"\\\"Kontaminasi\\/polusi lingkungan lokasi akibat pelaksanaan proyek Kebisingan suara akibat aktivitas alat berat\\\"\",\"Pelaksanaan konstruksi untuk jembatan yang berada di wilayah padat permukiman akan menimbulkan kemacetan pada titik pengalihan lalu lintas, sehingga dampak polusi meningkat pada titik tersebut Proyek dapat menyebabkan gangguan kesehatan dan kenyamanan, seperti rumah masyarakat rusak karena kegiatan konstruksi\",\"Spesifikasi yang dibutuhkan tidak dijelaskan secara rinci, keterlambatan dan kenaikan biaya spesifikasi output tidak jelas dan biasanya terjadi pada tahap pra-konstruksi\",\"\\\"Terjadinya kejadian fatality akibat kurangnya pengawasan dan SMK3 Kondisi cuaca ekstrim ataupun bencana alam terjadi pada saat pelaksanaan konstruksi Beberapa lokasi jembatan berada di permukiman padat penduduk sehingga tingkat kesulitan pelaksanaan konstruksi tinggi Terdapatnya utilitas pipa gas di lokasi jembatan\\\"\",\"\\\"Perubahan volume pekerjaan ataupun harga material Adanya klaim atau gugatan dari pihak ketiga\\\"\",\"Kurangnya Modal, SDM serta Management proyek yang buruk\",\"\\\"Desain jembatan belum mengakomodir beban maksimal kendaraan yang akan melewatinya, sehingga menyebabkan lifetime rencana dari Jembatan tidak tecapai. Desain jembatan tidak mengakomodir kerusakan akibat bencana alam seperti banjir menyebabkan ekstra\\/revisi desain\\\"\",\"\\\"Desain yang ada tidak mampu dilaksanakan, karena dalam perencanaan tidak mengindahkan kemudahan dalam proses konstruksi, seperti lahan bebas, lahan stockyard dan kesulitan dalam pekerjaan erection, serta tidak mengindahkan keamanan Keahlian SDM yang buruk, terbatasnya ketersediaan material & peralatan, dan terlambatnya pengembalian akses lokasi Terdapat hambatan pembangunan jembatan darurat sebagai akses pengganti, karena permasalahan permukiman liar\\\"\",\"\\\"Overloading kendaraan yang melintas menyebabkan kerusakan perkerasan maupun struktur jembatan Kesalahan pelaksanaan konstruksi tidak sesuai dengan desain jembatan Tidak teraturnya penempatan utilitas (pipa PDAM, kabel, dsb)\\\"\",\"\\\"Ketidaktersediaan peralatan dan material untuk melaksanakan konstruksi secara serentak Kegagalan atau ketidakmampuan Badan Usaha dalam mengelola operasional jembatan\\\"\",\"\\\"Terjadi kesalahan estimasi biaya O&M atau kenaikan tidak terduga Terjadi kenaikan harga tidak terduga pada komponen biaya maintenance\\\"\",\"Penawaran harga pekerjaan terlalu optimis\",\"Pembangunan jembatan yang bersamaan dengan pembangunan jalan, hal ini mengakibatkan pengiriman material dan alat konstruksi jembatan terputus\",\"Terjadi perubahan regulasi perpajakan dan kebijakan\",\"\\\"Proses perizinan yang berbelit Terjadi keputusan sepihak \\/tidak wajar dari otoritas terkait\\\"\",\"\\\"Secara keseluruhan lokasi jembatan ada di Pulau Jawa yang berada di wilayah potensi gempa Terdapat jembatan yang berlokasi di dataran rendah (potensi banjir dan rob)\\\"\",\"Peristiwa perang, kerusuhan, gangguan keamanan masyarakat\",\"Beberapa jembatan berada di wilayah aliran sungai besar yang menyebabkan besarnya debit air saat hujan deras\"]', 'PPK, PPTK, Kontraktor, Konsultan dan Masyarakat', '34', '34', NULL, '1. Pemerintah perlu memastikan proses pembebasan tanah dapat berjalan sesuai dengan ketentuan peraturan perundang-undangan dan memastikan Pembentukan tim appraisal yang independen dan berkualitas\r\nInventarisasi kebutuhan dan strategi pembebasan lahan\r\nPembentukan tim khusus percepatan pembebasan lahan terintegrasi dengan rencana konstruksi\r\nMelakukan konsultasi publik kepada masyarakat terdampak; 2. \"Melakukan studi AMDAL yang komprehensif (melibatkan semua stakeholder) dan melaksanakannya dengan baik\r\nMelaksanakan Instruksi Kerja & Toolbox Meeting (TBM) dengan QHSE (Quality, Health, Safety and Environment)', '1. Lahan tidak dapat digunakan karena perlu adanya relokasi penghuni dan prosesnya yang rumit; 2. Kesulitan pada kondisi lokasi yang tak terduga; 3.', '1. Pemerintah perlu memastikan proses pembebasan tanah dapat berjalan sesuai dengan ketentuan peraturan perundang-undangan dan memastikan Pembentukan tim appraisal yang independen dan berkualitas\r\nInventarisasi kebutuhan dan strategi pembebasan lahan\r\nPembentukan tim khusus percepatan pembebasan lahan terintegrasi dengan rencana konstruksi\r\nMelakukan konsultasi publik kepada masyarakat terdampak; 2. \"Melakukan studi AMDAL yang komprehensif (melibatkan semua stakeholder) dan melaksanakannya dengan baik\r\nMelaksanakan Instruksi Kerja & Toolbox Meeting (TBM) dengan QHSE (Quality, Health, Safety and Environment)', 'Kepala Dinas', '12 Bulan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2023-08-27 19:06:22', '2023-08-28 07:09:54'),
(1235, 20, 'Rehabilitasi Jembatan', 'Jumlah Jembatan Kabupaten yang Direhab', 'Identifikasi risiko, Analisis risiko, Evaluasi risiko, Pengembangan strategi mitigasi, dan Implementasi dan monitoring', '1. Kesulitan pada kondisi lokasi yang tak terduga; 2. Resiko Struktur Tanah; 3. Keterbatasan ruang kerja /working space konstruksi; 4. Kontaminasi/polusi ke lingkungan lokasi; 5. \"Terganggunya kenyamanan masyarakat yang berada di sekitar area proyek; 6. Ketidakjelasan spesifikasi output; 7. Gagal menjaga keselamatan dalam lokasi; 8. Kenaikan biaya konstruksi; 9. Kinerja kontraktor/subkontraktor yang buruk; 10. Kesalahan desain; 11. Terlambatnya penyelesaian konstruksi; 12. Buruk atau tidak tersedianya layanan; 13. Kegagalan manajemen proyek; 14. Kenaikan biaya energi–karena inefisiensi unit; 15. Kesalahan perhitungan penawaran; 16. konektivitas jaringan jalan dan transportasi; 17. Perubahan regulasi (dan pajak) yang umum; 18. Keterlambatan perolehan persetujuan perencanaan; 19. Bencana alam; 20. Force majeure politis; 21. Cuaca ekstrim', 'RS0.23.03.4.19', 'Dinas PU Bina Marga', '[null]', 'internal dan eksternal', 'C', '[\"Mengakibatkan kegagalan struktur yang berakibat keterlambatan proyek\",\"Mengakibatkan kegagalan struktur yang berakibat keterlambatan proyek\",\"Kesulitan dalam menempatkan alat dan material yang berakibat terhambatnya pelaksaan pekerjaan\",\"mengakibatkan pencemaran lingkungan sekitar\",\"proses mobilisasi alat dan material yang terganggu mengakibatkan pekerjaan terhambat\",\"mengakibatkan banyaknya perubahan perubahan baik anggaran hingga jenis material dan metode pengerjaan yang berakibat terlambatnya pekerjaan\",\"terjadinya kecelakaan kerja hingga rusaknya infrastruktur lainnya yang dapat berakibat terhambatnya pekerjaan\",\"mengakibatkan keterlambatan proyek karena pengurusan administrasii\",\"terjadi hambatan dalam pelaksanaan pekerjaan\",\"terjadinya kegagalan struktur yang berakibat terlambatnya pekerjaan\",\"terlambatnya penyelesainya pekerjaan\",\"tidak terkontrolnya kapasitas kendaraan yang melewati jembatan mengakibatkan overload pada struktur jembatan\",\"mengakibatkan keterlambatan pekerjaan\",\"terhambatanya penyelesaian pekerjaan\",\"mengakibatkan tidak selesainya pekerjaan\",\"terhambatnya pelaksanaan pekerjaan\",\"menghambat pelaksanaan pekerjaan\",\"mengakibatan keterlambatan \\/ kegagalan pekerjaan\",\"terhambatnya penyelesaian pekerjaan\",\"Terjadinya keterlampatan \\/ kegagalan proyek\"]', 'PPK, PPTK, Kontraktor, Konsultan dan Masyarakat', '34', '34', NULL, 'Melakukan studi AMDAL yang inklusif dengan melibatkan semua pihak terkait dan menjalankannya secara efektif', '\"Terjadinya longsoran tebing sungai di luar rencana\r\nKondisi aliran sungai yang deras akibat curah hujan tinggi\"', 'Melakukan studi AMDAL yang komprehensif (melibatkan semua stakeholder) dan melaksanakannya dengan baik\r\nMelaksanakan Instruksi Kerja & Toolbox Meeting (TBM) dengan QHSE (Quality, Health, Safety and Environment)\"', 'Kepala Dinas', '12 Bulan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2023-08-27 19:22:09', '2023-08-28 07:09:54'),
(1236, 20, 'Pemeliharaan Rutin Jembatan', 'Jumlah Jembatan Kabupaten yang di pelihara secara rutin', 'Identifikasi risiko, Analisis risiko, Evaluasi risiko, Pengembangan strategi mitigasi, dan Implementasi dan monitoring', '1. Bencana alam; 2. Force majeure politis; 3. Cuaca ekstrim', 'RS0.23.03.4.19', 'Dinas PU Bina Marga', '[\"mengakibatan keterlambatan \\/ kegagalan pekerjaan\",\"terhambatnya penyelesaian pekerjaan\",\"Terjadinya keterlampatan \\/ kegagalan proyek\"]', 'internal dan eksternal', 'UC', '[\"\\\"Secara keseluruhan lokasi jembatan ada di Pulau Jawa yang berada di wilayah potensi gempa Terdapat jembatan yang berlokasi di dataran rendah (potensi banjir dan rob)\\\"\",\"Peristiwa perang, kerusuhan, gangguan keamanan masyarakat\",\"Beberapa jembatan berada di wilayah aliran sungai besar yang menyebabkan besarnya debit air saat hujan deras\"]', 'PPK, PPTK, Kontraktor, Konsultan dan Masyarakat', '34', '34', NULL, 'Menggunakan teknologi pendeteksi bencana, dan meminta perizinan pejabat setempat, serta menyiasati cuaca ekstrem', 'Belum tersedianya teknologi pendeteksi bencana secara dini, kurangnya kerjasama dengan petugas keamanan sekitar,  dan terdapat kendala apabila debit air tinggi', '1. Penggunaan teknologi yang mampu meminimalisir dampak bencana alam\r\nSurvei yang memadai terhadap kondisi geologi dan kondisi alam lainnya pada\r\nsaat desain; 2. melaksanakan kerja sama dengan petugas keamanan sekitar\r\n; 3. meminta izin kepada badan khusus untuk menghambat aliran air sungai sementara sampai jembatan siap menerima debit sungai yang besar', 'Kepala Dinas', '12 Bulan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2023-08-27 19:26:21', '2023-08-28 07:09:54'),
