(27, 2, 'RENJA', 12, NULL, NULL, '[\"1.\\tPerencanaan, Penganggaran, dan Evaluasi Kinerja Perangkat Daerah (Jumlah dokumen, perencanaan, penganggaran dan evaluasi kinerja perangkat Daerah) 2.\\tAdministrasi Keuangan Perangkat Daerah (Persentase Administrasi Keuangan Daerah) 3.\\tAdministrasi Kepegawaian Perangkat Daerah (Persentase administrasi Kepegawaian Perangkat Daerah) 4.\\tAdministrasi Umum Perangkat Daerah (Persentase administrasi umum perangkat daerah) 5.\\tPengadaan Barang Milik Daerah Penunjang Urusan Pemerintah Daerah (Persentase pengadaan barang milik daerah penunjang urusan pemerintah daerah) 6.\\tPenyediaan Jasa Penunjang Urusan Pemerintahan Daerah (Persentase penyediaan jasa urusan pemerintah daerah) 7.\\tPemeliharaan Barang Milik Daerah Penunjang Urusan (Persentase pemeliharaan barang milik daerah penunjang urusan pemerintah daerah) 8.\\tPenyusunan Rencana Tenaga Kerja Mikro (RTK) (Jumlah penyusunan dokumen Rencana Tenaga Kerja (RTK)) 9.\\tPelaksanaan Pelatihan berdasarkan Unit  Kompetensi (Jumlah lulusan pelatihan berdasarkan unit kompetensi) 10.\\tPembinaan Lembaga Pelatihan Kerja Swasta (Jumlah lembaga pelatihan kerja swasta yang memiliki perizinan) 11.\\tKonsultansi Produktivitas pada Perusahaan Kecil (Jumlah produktivitas SDM perusahaan yang meningkat) 12.\\tPengukuran Produktivitas Tingkat Daerah Kabupaten\\/Kota (Jumlah perusahaan yang menerapkan program peningkatan produktivitas) 13.\\tPelayanan Antarkerja di Daerah Kabupaten\\/Kota (Jumlah pelayanan Antarkerja) 14.\\tPengelolaan Informasi Pasar Kerja (Jumlah pencari kerja yang mendapatkan informasi pasar kerja) 15.\\tPelindungan PMI  (Pra  dan Purna Penempatan) di Daerah Kabupaten\\/Kota (Jumlah CPMI dan PMI Purna yang dilindungi) 16.\\tPenerbitan Perpanjangan IMTA yang Lokasi Kerja dalam 1 (satu) Daerah Kabupaten\\/Kota (Jumlah penerbitan perpanjangan IMTA di Kabupaten Lamongan) 17.\\tPengesahan Peraturan Perusahaan dan Pendaftaran Perjanjian Kerja Bersama untuk Perusahaan yang hanya Berope