(30, 3, 'RENJA', 23, NULL, NULL, '[\"1.Perencanaan,penghanggaran,dan evaluasi kinerja perangkat daerah(Presentase dokumen perencanaan dan evaluasi kinerja  perangkat daerah yang di susun tepat waktu) 2. Administrasi keuangan daerah(Prosentase penyediaan administrasi dan pelaporan keuangan yang tepat waktu) 3.Administrasi Kepegawaian Peramngkat daerah (prosentase administrasi kepegawaianh yang tercukupi) 4.Administrasi umum perangkat daerah(Presentase administrasi umum yang tercukupi dengan baik) 5.Pengadaan barang milik daerah penunjang urusan pemerintah daerah(Presentase unit kerja internal yang terlayani dengan baik) 6.Penyediaan jasa penunjang urusan pemerintahan daerah(Presentasie unit kerja internal yang terlayani dengan baik) 7. Pemeliharan barang milik daerah penu njang urusan pemerintah daerah(Presentase admin istrasi pemeliharaan BMD dengan baik 8.Penyediaan fasilitas pelayanan kesehatan untuk UKM dan UKP kewenangan daerah kabupaten kota ( prosentase fasyankes sesuai standart) 9.penyediaan layanan kesehatan UKM dan UKP rujukan tingkat daerah kabupateen \\/kota (prosentase masyarakat yang mendapatkan pelayanan kesehatan sesuai dengan SPM 10.penyelenggaraaan sintim informasi kesehatan secara terintegrasi (prosebtase puskesmas yang menggunakan e-sikla ) 11.Penerbitan izin rumah sakit kelas c dan d dan fasilitas pelayanan kesehatan tingkat daerah kabupaten\\/kota (Jumlah izin rumah sakit kelas c dan d dan fasilitas pelayanan kesehatan tingkat daerah kab atau kota ) 12.Pemberian izin praktek tenaga kesehatan di wilayah kabupaten\\/kota(prosentase tenaga kesehatan yang memnuhi stanart kompetensi) 13.Perencanaan kebutuhan dan pendayagunaan sumberdaya manusia kesehatan  untuk ukp dan ukm di wilayah kabupaten\\/kota 14. Pengembangan mutu dan peningkatan kompeensi teknis  sumber daya m,anusia kesehatan tingkat derah kabupaten \\/kota (Prosentase mutu sdmk yang meningkat)15.Pemberian izin apotek,toko obat,toko alat kesehatan dan optikal,usaha mikro obat tradisional(UMOT) (prosentase  apotik ,toko obat,toko alat kesehatan dan optikal UMOT yang memiliki izin 16.Penerbitan sertifikat produksi pangan industri rumah tangga dan nomor P-IRT sebagai jin produksi untuk produk makanan dan minuman tertentu yang dapat di produksi oleh industri rumah tangga.(presentase peniungkatan P-IRT) 17.Penerbitan setifikat laik Hiegiene sanitasi tempat pengeloan makanan (TPM) anatara lain jasa boga,rumah  makan \\/restoran dan depot air minum (DAM) (presentase peningkatan penerbitan sertifikat laik higiene sanitasi tempat pengelolaan makanan  (TPM) 18.advokasi,pemeberdayaan kemitraan peningkatan peran serta masyarakat dan lintas sektor tingkat daerah kabupaten kota (Prosentase peningkatan advokasi pemebrdayaanj kemitraan peningkatan peran serta masyarakat dan lintas sektor ) 19. Pelaksanaan sehat dalam rangka promotif preventif tingkat daerah kabupaten \\/ kota (prosentase puskesmas yang melaksanakan kegiatan promotif dan prefentif ) 20.penegembangan dan pelaksanaan upaya kesehatan besumber daya masyarakat (UKBM) tingkat daerah kabupaten\\/kota (Prosentase peningkatan UKBM)\"]', 13, 10, NULL, NULL),
(31, 6, 'RENJA', 15, NULL, NULL, '[\"1.\\tPerencanaan, Penganggaran, dan Evaluasi Kinerja Perangkat Daerah (Jumlah Dokumen Perencanaan, Penganggaran, dan Laporan Evaluasi Kinerja yang Tepat Waktu) 2.\\tAdministrasi Keuangan Perangkat Daerah (Jumlah Dokumen Administrasi Keuangan Tepat Waktu) 3.\\tAdministrasi Kepegawaian Perangkat Daerah (Prosentase peningkatan kapasitas sumber daya aparatur dan terpenuhinya Pakaian Dinas beserta Atribut Kelengkapannya) 4.\\tAdministrasi Umum Perangkat Daerah (Prosentase Unit Kerja Internal Yang Terlayani Dengan Baik) 5.\\tPengadaan Barang Milik Daerah Penunjang Urusan Pemerintah Daerah (Prosentase Terpenuhinya Sarana dan Prasarana Penunjang Aparatur) 6.\\tPenyediaan Jasa Penunjang Urusan Pemerintahan Daerah (Prosentase Jasa Penunjang Urusan Pemerintahan tersedia Dengan Baik) 7.\\tPemeliharaan Barang Milik Daerah Penunjang Urusan Pemerintahan Daerah (Prosentase Sarana dan Prasarana Penunjang Aparatur Kondisi Baik) 8.\\tKoordinasi dan Penyusunan Rencana Anggaran Daerah (Jumlah dokumen Perencanaan keuangan yang disusun) 9.\\tKoordinasi dan Pengelolaan Perbendaharaan Daerah (Jumlah dokumen laporan BUD yang disusun) 10.\\tKoordinasi dan Pelaksanaan Akuntansi dan Pelaporan Keuangan Daerah (Jumlah dokumen laporan keuangan daerah yang disusun) 11.\\tPenunjang Urusan Kewenangan Pengelolaan Keuangan Daerah (Jumlah Dokumen Laporan Urusan Kewenangan Pengelolaan Keuangan Daerah yang disusun) 12.\\tPengelolaan Data dan Implementasi Sistem Informasi Pemerintah Daerah Lingkup Keuangan Daerah (Jumlah Penyediaan Sistem Informasi keuangan daerah yang informatif) 13.\\tPengelolaan Barang Milik Daerah (Jumlah dokumen laporan barang milik daerah yang di susun)\"]', 9, 46, NULL, NULL),
