(411, 4, 'RENJA', 66, NULL, NULL, '[\"1. Kegiatan Administrasi Barang Milik Daerah pada Perangkat Daerah (Jumlah bagian lingkup setda yang data asetnya pada KIB sesuai dengan kondisi rill). 2.  Kegiatan Administrasi Kepegawaian Perangkat Daerah (Jumlah kebutuhan pakaian dinas di lingkup setda yang tercukupi Kelengkapan). 3.  Kegiatan Administrasi Umum Perangkat Daerah(Jumlah kegiatan administrasi umum perangkat daerah lingkup setda yang terfasilitasi). 4. Pengadaan Barang Milik Daerah Penunjang Urusan Pemerintah Daerah(Jumlah Kegiatan  Pengadaan Barang Milik Daerah Penunjang Urusan Pemerintah Daerah Lingkup Setda yang Terfasilitasi). 5. Kegiatan Penyediaan Jasa Penunjang Urusan Pemerintahan Daerah(Jumlah kegiatan jasa penunjang urusan pemerintah daerah di lingkup setda yang terfasilitasi). 6. Kegiatan Pemeliharaan Barang Milik Daerah Penunjang Urusan Pemerintahan(Jumlah kegiatan pemeliharaan barang milik daerah di lingkup setda yang terfasilitasi). 7. Kegiatan Administrasi Keuangan dan Operasional Kepala Daerah dan Wakil Kepala Daerah(Jumlah Kegiatan administrasi keuangan dan operasional kepala daerah dan wakil kepala daerah). 8. Kegiatan Fasilitasi Kerumahtanggaan Sekretariat Daerah(Jumlah kegiatan kerumahtanggaan lingkup setda yang terfasilitasi)\"]', 75, 92, NULL, NULL),
