n Bidang Pendidikan Politik, Etika Budaya Politik, Peningkatan Demokrasi, Fasilitasi Kelembagaan Pemerintahan, Perwakilan dan Partai Politik, Pemilihan Umum\\/Pemilihan Umum Kepala Daerah, serta Pemantauan Situasi Politik)\"]', 6, 17, NULL, NULL),
(427, 4, 'RENJA', 62, NULL, NULL, '[\"1.Pelaksanaan Kebijakan Kesejahteraan Rakyat(Pelaksanaan Kebijakan Kesejahteraan Rakyat) 2.Fasilitasi dan Koordinasi Hukum(Prosentase Produk Hukum yang terfasilitasi)3.Administrasi Tata Pemerintahan(Jumlah Kebijakan dan Laporan Tata Kelola Pemerintahan yang ditindaklanjuti)4.Fasilitasi Kerja Sama Daerah(Prosentase Fasilitasi Kerja Sama Daerah yang ditindaklanjuti)5.Pemantauan Kebijakan Sumber Daya Alam(Jumlah Kebijakan Sumber daya Alam yang di evaluasi)6.Pelaksanaan Kebijakan Perekonomian(Jumlah Kebijakan Perekonomian Yang Dihasilkan)7.Pengelolaan Barang dan Jasa(Prosentase Pelayanan Pengadaan Barang\\/Jasa Pemerintah secara Online)8.Administrasi Pembangunan(Jumlah bahan rumusan kebijakan bidang administrasi pembangunan yang disusun sesuai ketentuan)9.Perencanaan, Penganggaran, dan Evaluasi Kinerja Perangkat Daerah(Jumlah dokumenperencanaan dan evaluasi kinerja yang disusun)10.Administrasi Keuangan Perangkat Daerah(Jumlah Bagian di Setda Yang Penatausahaan Keuangannya Telah Tertib dan Sesuai Aturan)11.Administrasi Barang Milik Daerah pada Perangkat Daerah(Jumlah bagian lingkup setda yang data asetnya pada KIB sesuai dengan kondisi rill)12.Administrasi Kepegawaian Perangkat Daerah(Jumlah kebutuhan pakaian dinas di lingkup setda yang tercukupi )13.Administrasi Umum Perangkat Daerah(Jumlah kegiatan administrasi umum perangkat daerah lingkup setda yang terfasilitasi)14.Pengadaan Barang Milik Daerah Penunjang Urusan Pemerintah Daerah(Jumlah kegiatan pengadaan barang milik daerah penunjang urusan pemerintah daerah lingkup setda yang terfasilitasi)15.Penyediaan Jasa Penunjang Urusan Pemerintahan Daerah(Jumlah kegiatan jasa penunjang urusan pemerintah daerah di lingkup setda yang terfasilitasi)16.Pemeliharaan Barang Milik Daerah Penunjang Urusan Pemerintah Daerah(Jumlah kegiatan pemeliharaan barang milik daerah di lingkup setda yang terfasilitasi)17.Administrasi Keuangan dan Operasional Kepala Daerah dan Wakil Kepala Daerah(Jumlah Kegiatan administrasi keuangan dan operasional kepala daerah dan wakil kepala daerah)18.Fasilitasi Kerumahtanggaan Sekretariat Daerah(Jumlah kegiatan kerumahtanggaan lingkup setda yang terfasilitasi)19.Pelaksanaan Protokol dan Komunikasi Pimpinan(Prosentase pelayanan bidang protokol dan komunikasi pimpinan yang dilaksanakan)20.Penataan Organisasi Perangkat Daerah(Persentase Perangkat Daerah yang ditata sesuai dengan aturan)\"]', 2, 87, NULL, NULL),
