(456, 4, 'RENJA', 94, NULL, NULL, '[\"1. Perencanaan, Penganggaran dan Evaluasi Kinerja Perangkat Daerah (Prosentase jumlah dokumen perencanaan, laporan kinerja, dan laporan keuangan yang tepat waktu), 2. Administrasi Keuangan Perangkat Daerah (Jumlah laporan keuangan yang disusun tepat waktu), 3. Administrasi Kepegawaian Perangkat Daerah (Prosentase pegawai yang mendapatkan layanan kepegawaian dengan baik), 4. Administrasi Umum Perangkat Daerah (Jumlah laporan persediaan barang dan jasa yang tepat waktu), 5. Pengadaan Barang Milik Daerah Penunjang Urusan Pemerintah Daerah (Prosentase ketersediaan sarana dan prasarana yang dibutuhkan), 6. Penyediaan Jasa Penunjang Urusan Pemerintahan Daerah (Prosentase layanan jasa penunjang yang tersedia dengan baik), 7. Pemeliharaan Barang Milik Daerah Penunjang Urusan Pemerintahan Daerah (Prosentase barang milik daerah dalam kondisi baik), 8. Penyelenggaraan Urusan Pemerintahan yang Tidak Dilaksanakan oleh Unit Kerja Perangkat Daerah yang ada di Kecamatan (Jumlah koordinasi\\/fasilitasi pelayanan publik kecamatan), 9. Koordinasi Kegiatan Pemberdayaan Desa (Jumlah desa yang koordinasi pemberdayaan desa), 10. Pemberdayaan dan Kesejahteraan Keluarga Tingkat Kecamatan dan Kelurahan (Jumlah laporan hasil pemberdayaan masyarakat melalui gerakan PKK tingkat kecamatan yang dilaksanakan), 11. Penyelenggaraan Urusan Pemerintahan Umum Sesuai Penugasan Kepala Daerah (Jumlah koordinasi urusan pemerintahan umum), 12. Fasilitasi, Rekomendasi dan Koordinasi Pembinaan dan Pengawasan Pemerintahan Desa (Jumlah desa yang dilakukan pembinaan dan pengawasan pemerintahan desa).\"]', 50, 104, NULL, NULL),
