INSERT INTO `reviu_menus` (`id`, `menu`, `definisi`, `step`) VALUES
(1, 'Program Reviu Penetapan Konteks', 'mengidentifikasi sasaran strategis/program strategis/kegiatan/proses bisnis unit Pemilik Risiko yang merupakan penjabaran dari visi dan misi Pemda\r\n        ', '<ol>\r\n        <li>Pastikan apakah identitas pemilik risiko dan periode penerapan manajemen risiko telah sesuai dengan ruang lingkup dan sasaran reviu</li>\r\n        <li>Pastikan apakah identifikasi sasaran strategis dan/atau program strategis telah dilakukan dengan mengacu pada dokumen Rencana Strategis (Renstra)/ Perjanjian Kinerja (Perkin) unit Pemilik Risiko. Bandingkan dokumen Renstra/Perkin unit kerja dengan isian Formulir Penetapan Konteks</li>\r\n        </ol>'),
(2, 'Program Reviu Identifikasi Risiko', 'mengidentifikasi seluruh potensi masalah yang relevan dan terkait dengan pencapaian sasaran\r\n        ', '<ol>\r\n        <li>Dapatkan kertas kerja atas perumusan/penilaian risiko bidang/unit kerja</li>\r\n        <li>Pastikan risiko-risiko yang diidentifikasi telah mewakili masing- masing konteks minimal konteks Sastra yang ada di dokumen Renstra/Perkin. Kecukupan risiko yang diidentifikasi dinilai memadai jika atas konteks Sastra telah diidentifikasi, minimal 1 (satu) risiko atas masing-masing jenis Sastra</li>\r\n        <li>Lakukan analisis keselarasan pernyataan risiko dengan konteks yang ditetapkan</li>\r\n        <li>Lakukan analisis kausalitas, apakah uraian dampak pada formulir identifikasi risiko memiliki korelasi/hubungan sebab akibat dengan pernyataan risiko</li>\r\n        </ol>'),
(3, 'Program Reviu Analisis Risiko', 'menilai akurasi level risiko unit kerja; besaran skala dampak dan kemungkinan\r\n        ', '<ol>\r\n        <li>Lakukan telaah dokumen apakah semua risiko telah ditentukan besaran dan levelnya sesuai dengan matriks analisis risiko</li>\r\n        <li>Pastikan konsistensi kode risiko pada formulir identifikasi risiko dengan formulir analisis risiko</li>\r\n        <li>Lakukan wawancara untuk menggali informasi terkait justifikasi dalam penentuan skor probabilitas dan dampak dan apakah penentuan skor tersebut telah berpedoman pada kriteria kemungkinan dan dampak sebagaimana dalam ketentuan yang berlaku</li>\r\n        <li>Lakukan uji petik untuk memastikan apakah kriteria risiko telah digunakandengan tepat dalam penentuan level risiko</li>\r\n        <li>Dapatkan kertas kerja atau wawancara terhadap unit kerja untuk mengetahui teknik atau cara yang digunakan dalam menentukan level risiko</li>\r\n        <li>Cek apakah besaran risiko pada kertas kerja telah konsisten dengan risk register</li>\r\n        <li>Lakukan telaah dokumen apakah pengendalian intern telah dipertimbangkan dalam mengestimasi level risiko</li>\r\n        </ol>'),
(4, 'Program Reviu Evaluasi Risiko', 'memastikan bahwa unit kerja telah memiliki risiko prioritas.\r\n        ', '<ol>\r\n        <li>Dapatkan selera risiko pimpinan unit kerja terkait. Cek apakah penilaian atas risiko prioritas telah dilakukan dengan tepat yaitu bahwa risikoprioritas merupakan risiko yang levelnya berada diatas selera risiko tersebut</li>\r\n        <li>Analisis dokumen atas keputusan untuk memitigasi atau tidak memitigasisuatu risiko yang diambil oleh unit kerja; (Notulen Rapat FGD)</li>\r\n        <li>Lakukan telaah dokumen apakah unit kerja telah mendokumentasikan aktivitas evaluasi risiko dengan baik; (Form Evaluasi)</li>\r\n        </ol>'),
(5, 'Program Reviu Respon Risiko', 'memastikan bahwa unit kerja telah menetapkan respon yang tepat untuk mengatasi risiko prioritas.\r\n        ', '<ol>\r\n        <li>Dapatkan daftar risiko prioritas, dan rencana tindak pengendalian</li>\r\n        <li>Pastikan penyebab yang diidentifikasi merupakan akar penyebab dari risiko prioritas</li>\r\n        <li>Bandingkan RTP dengan daftar risiko prioritas. Pastikan seluruh risiko prioritas telah disusun RTP-nya</li>\r\n        <li>Cek kertas kerja RTP. Pastikan penanggung jawab dan target waktu telah ditentukan</li>\r\n        <li>Penentuan penanggung jawab yang tepat terkait dengan pihak yang menangani risiko tersebut jika terjadi</li>\r\n        </ol>'),
(6, 'Program Reviu Informasi dan Komunikasi', 'memastikan bahwa kegiatan informasi dan komunikasi yang diperlukan dalam penerapanmanajemen risiko telah dilakukan dengan memadai oleh unit kerja\r\n        ', '<ol> <li>Analisis apakah terdapat RTP yang belum diinformasikan sesuai jadwal, apa penyebabnya, serta solusi yang akan dilaksanakan</li></ol>'),
(7, 'Program Reviu Pemantauan', 'Memastikan bahwa keterjadian risiko dan pelaksanaan RTP, telah dipantau secara memadai.\r\n        ', '<ol>\r\n        <li>Dapatkan kertas kerja pemantauan pelaksanaan RTP</li>\r\n        <li>Bandingkan kertas kerja pemantauan dengan daftar RTP</li>\r\n        <li>Cek apakah RTP yang dijadwalkan s.d. triwulan yang direviu telah dilaksanakan atau RTP pada triwulan berikutnya yang telah dilaksanakanmendahului jadwal</li>\r\n        <li>Dapatkan informasi penyebab apabila terdapat RTP yang tidak/terlambatdirealisasikan</li>\r\n        <li>Dapatkan kertas kerja pemantauan keterjadian risiko</li>\r\n        <li>Cek apakah ada keterjadian risiko</li>\r\n        <li>Cek apakah keterjadian risiko telah dicatat pernyataan risiko terkait, waktu kejadian, tempat kejadian, dan pemicu keterjadian</li>\r\n        <li>Cek apakah ada keterjadian risiko yang belum teridentifikasi</li>\r\n        <li>Analisis apakah rekomendasi yang diusulkan telah tepat</li>\r\n        </ol>');
INSERT INTO `reviu_menu_data` (`id`, `periode_id`, `reviu_menu_id`, `entitas_id`, `simpulan`, `created_at`, `updated_at`) VALUES
(1, 4, 1, 73, '1. manajemen resiko milik Bagian Sumber Daya Alam Sekretariat Daerah telah sesuai dengan ruang lingkup dan sasaran reviu\r\n2. identifikasi sasaran strategis telah mengacu pada dokumen renstra unit Sekretariat Daerah', NULL, '2023-08-01 20:40:53'),
(2, 4, 2, 73, 'formulir identifikasi risiko yang telah diisi memiliki korelasi dengan pernyataan risiko', NULL, '2023-08-01 20:43:10'),
(3, 4, 3, 73, 'kurang akuratnya level risiko unit kerja, besaran skala dampak dan kemungkinan dikarenakan pemahaman antar responden berbeda terkait pertanyaan resiko', NULL, '2023-08-01 20:46:43'),
(4, 4, 4, 73, 'Bagian Sumber Daya Alam Sekretariat Daerah belum maksimal mendokumentasikan aktivitas evaluasi resiko', NULL, '2023-08-01 20:50:00'),
(5, 4, 5, 73, 'Bagian Sumber Daya Alam Sekretariat Daerah telah menetapkan respon yang tepat untuk mengatasi risiko prioritas', NULL, '2023-08-01 20:51:09'),
(6, 4, 7, 73, 'rekomendasi yang diusulkan untuk penyelesaian kejadian resiko sudah tepat', NULL, '2023-08-01 20:56:02'),
(7, 4, 6, 73, 'masih terdapat RTP yang belum sesuai jadwal dikarenakan kegiatan Bagian Sumber Daya Alam Sekretariat Daerah yang padat', NULL, '2023-08-01 20:57:33'),
(8, 2, 1, 76, '1. Identitas pemilik risiko dan periode penerapan manajemen risiko telah sesuai dengan ruang lingkup dan sasaran reviu\r\n2. Sasaran Strategi Renstra : 1. Meningkatkan manajemen internal perangkat daerah\r\n                                                  2. Terjaminnya kualitas pelayanan kesehatan\r\n    Formulir Penetapan Konteks :', NULL, '2023-08-07 22:40:23'),
(9, 2, 5, 76, 'Risiko Strategis OPD :\r\n1. Tidak tersedianya pelayanan dokter spesialis tertentu\r\n    RTP : 1. Melakukan pengadaan dokter spesialis tertentu\r\n              2. Melakukan MoU dengan dokter spesialis tertentu\r\n    Penanggungjawab : Kasubag Umum, Kepegawaian dan Keuangan\r\n    Target waktu : 6 bulan\r\n2. Adanya sanksi/denda keterlambatan pembayaran listrik, air dan internet\r\n    RTP : 1. Membuat manajemen waktu tagihan belanja listrik, air dan internet\r\n              2.. Menggunakan genset saat akses dan jaringan terputus\r\n    Penanggungjawab : Kasubag Umum, Kepegawaian dan Keuangan\r\n    Target waktu : 3 bulan \r\n3. Kunjungan pasien/masyarakat ke RSUD Karangkembang masih dibawah target\r\n    RTP : 1. Melakukan kegiatan promkes melalui Bakti Sosial secara terjadwal setiap bulan\r\n              2. Duta Layanan RSUD Karangkembang\r\n              3. Melakukan monitoring dan evaluasi setiap bulan dengan tim promosi kesehatan RSUD Karangkembang\r\n   Penanggungjawab : RSUD Karangkembang\r\n   Target waktu :6 bulan\r\n\r\nRisiko Operasional OPD :\r\n1. Rendahnya capaian prosentase BOR\r\n    RTP : Meningkatkan kualitas sarana dan prasarana yang tersedia dan meningkatkan promosi dan sosialisasi rumah sakit\r\n    Penanggungjawab : Kasubag Umum, Kepegawaian dan Keuangan\r\n    Target waktu : 3 bulan', NULL, '2023-08-07 23:20:08'),
(10, 2, 6, 76, 'Semua RTP telah di informasikan sesuai dengan media/bentuk sarana pengkomunikasian yaitu :\r\nRisiko Strategis OPD :\r\n1. Surat permohonan  MoU dengan dokter spesialis \r\n2. Rekening tagihan belanja listrik, air dan internet\r\n3. SK Direktur, Tim Promosi Kesehatan RSUD Karangkembang \r\nRisiko Operasional OPD :\r\n1. SK Direktur , Tim PKRS, Leaflet, Media Sosial', NULL, '2023-08-07 23:31:54'),
(11, 2, 2, 76, '1. Tidak tersedianya pelayanan dokter spesialis tertentu\r\n     Dampak : Kepuasan pasien rendah, Kualitas dan efektivitas pelayanan rendah\r\n2. Adanya sanksi/denda keterlambatan pembayaran listrik, air dan internet\r\n    Dampak : Terputusnya akses dan jaringan\r\n3. Kunjungan pasien/masyarakat ke rumah sakit masih dibawah target\r\n    Dampak : Angka kunjungan pasien belum memenuhi target', NULL, '2023-08-08 19:45:34');
