(33, 5, 'PENEGAKAN INTEGRITAS DAN NILAI ETIKA', 'Memadai', 'Memadai', 'Kondisi di OPD cukup memadai', '-', NULL, NULL, 'Peraturan Bupati Lamongan Nomor 39 Tahun 2021 Tentang Nilai Dasar,Kode Etik Dan Kode Perilaku Aparatur Sipil Negara', 'Kondisi di OPD cukup memadai melakukan pemantauan secara intensif terhadap pelaksanaan aturan perilaku yang dilakukan oleh seluruh pegawai Badan Kesatuan Bangsa dan Politik Kabupaten Lamongan', 'Sekretaris', '1 Tahun', 6, 17, '2022-12-05 19:04:16', '2023-03-27 20:56:25'),
(34, 5, 'KOMITMEN TERHADAP KOMPETENSI', 'Kurang Memadai', 'Kurang Memadai', 'Adanya pegawai yang belum secara tepat mengisi posisi/jabatan. Masih adanya Nilai IP-ASN OPD yang masih rendah dan disebabkan dimensi kompetensi ASN yang rendah.', 'Pelanggaran aturan perilaku/kode etik belum ditindaklanjuti sesuai ketentuan yang berlaku', NULL, NULL, 'Aplikasi SiMEGILAN (Sistem Informasi dan Manajemen Kepegawaian Lamongan ) terkait IP-ASN dan Aplikasi SIAPMEN (Sistem Integrasi Absensi Pegawai dengan E-Performent) terkait Absensi Pegawai/ASN', 'Melakukan Evaluasi Kinerja Secara Berkala dan Pemberian Reward dan Punishment dari hasil pengukuran kinerja', 'Kepala Badan', '1 Tahun', 6, 17, '2022-12-05 19:04:16', '2023-03-27 20:56:25'),
(35, 5, 'KEPEMIMPINAN YANG KONDUSIF', 'Memadai', 'Memadai', 'Kondisi di OPD cukup memadai', '-', NULL, NULL, 'LHE SAKIP 2022', 'Kondisi di OPD cukup memadai namun tetap memberikan arahan kepada seluruh pegawai dan seluruh organisasi dalam melakukan perubahan untuk mecapai kinerja yang lebih baik', 'Kepala Badan', 'Tribulanan\r\n(Juanuari, April, Juli, Oktober)', 6, 17, '2022-12-05 19:04:16', '2023-03-27 20:56:25'),
(36, 5, 'PEMBENTUKAN STRUKTUR ORGANISASI YANG SESUAI DENGAN KEBUTUHAN', 'Memadai', 'Memadai', 'Sudah cukup memadai namun masih perlu dilakukan pembaruan susunan organisasi terhadap pejabat fungsional dan informasi terkait pedoman dalam penyususnannya', '-', NULL, NULL, 'Setiap Urusan telah dilaksanakan oleh OPD dan unit kerja yang tepat yang dituangkan dalam SOTK dalam Perbup No 88 Tahun 2021 ttg TUSI BAKESBANGPOL', 'Kondisi di OPD cukup memadai namun tetap melaksanakan Sosialisasi terkait SOTK Pejabat Fungsional dikarenakan masih adanya Rekrutmen, retensi, mutasi, maupun promosi pemilihan SDM sewaktu-waktu', 'Bagian Organisasi', '1 Tahun', 6, 17, '2022-12-05 19:04:16', '2023-03-27 20:56:25'),
(37, 5, 'PENDELEGASIAN WEWENANG DAN TANGGUNG JAWAB YANG TEPAT', 'Memadai', 'Memadai', 'Kondisi di OPD cukup memadai', '-', NULL, NULL, 'Rapat Evaluasi Capaian Kinerja Pegawai Setiap Tiga Bulan Sekali (Triwulanan)', 'Kondisi di OPD cukup memadai namun tetap melaksanakankoordinasi dan sosialisasi SOP pendelegasian wewenang terkait batasan kewenangan kepada seluruh pegawai Badan Kesatuan Bangsa dan Politik Kabupaten Lamongan', 'Sekretaris', 'Setiap bulan', 6, 17, '2022-12-05 19:04:16', '2023-03-27 20:56:25'),
(38, 5, 'PENYUSUNAN DAN PENERAPAN KEBIJAKAN YANG SEHAT TENTANG PEMBINAAN SUMBER DAYA MANUSIA', 'Memadai', 'Memadai', 'Kondisi di OPD cukup memadai', '-', NULL, NULL, 'Pendelegasian Wewenang Telah Ditentukan Dengan Tepat', 'Kondisi di OPD cukup memadai namun tetap melakukan sosialisasi dan penerapan secara bertahap kebijakan dan prosedur pengelolaan SDM sesuai peraturan perundang-undangan terbaru (Peraturan Pemerintah RI Nomor 11 Tahun 2017 tentang Manajemen Pegawai Negeri Sipil)', 'Kasubag Umum dan Kepegawaian', 'Januari-Februari', 6, 17, '2022-12-05 19:04:16', '2023-03-27 20:56:25'),
(39, 5, 'PERWUJUDAN PERAN APARAT PENGAWASAN INTERN PEMERINTAH YANG EFEKTIF', 'Memadai', 'Memadai', 'Kondisi di OPD cukup memadai', '-', NULL, NULL, 'LHP (Laporan Hail Pemeriksaan) Oleh Inspektorat tahun 2022', 'Kondisi di OPD cukup memadai namun tetap memantau wewenang  diberikan  kepada pegawai  agar sesuai  dengan tanggung  jawabnya  dalam rangka  pencapaian  tujuan penyelenggaraan tugas dan fungsi Instansi Pemerintah.', 'Kepala Badan', '1 Tahun', 6, 17, '2022-12-05 19:04:16', '2023-03-27 20:56:25'),
(40, 5, 'HUBUNGAN KERJA YANG BAIK DENGAN INSTANSI PEMERINTAH TERKAIT', 'Memadai', 'Memadai', 'Kondisi di OPD cukup memadai', '-', NULL, NULL, 'Telah terbangun hubungan kerja yang baik dengan instansi yang terkait atas fungsi pengawasan/pemeriksaan (inspektorat, BPKP, dan BPK) melalui Pemeriksaan BPK', 'Kondisi di OPD cukup memadai namun tetap melanjutkan  hubungan  kerjasama yang baik antar instansi yang terkait dengan rapat-rapat  Koordinasi  antar SKPD serta adanya pemeriksaan rutin dari BPK dan Inspektorat.', 'Sekretaris', '1 Tahun', 6, 17, '2022-12-05 19:04:16', '2023-03-27 20:56:25'),
