(42, 6, 'KOMITMEN TERHADAP KOMPETENSI', 'Kurang Memadai', 'Kurang Memadai', 'Telah dilaksanakan kegiatan bimbingan teknis setiap tahun untuk meningkatkan kompetensi pegawai, namun tingkat kehadirannya belum 100%.', 'Tingkat kompetensi semakin meningkat.', NULL, NULL, 'Dokumen Kepegawaian', 'Terus mendorong seluruh ASN Badan Pendapatan Daerah untuk meningkatkan kompetensinya melalui keikut sertaan bimtek baik yang diselenggarakan secara internal maupun eksternal', 'Sekretaris', 'Juli 2023', 8, 45, '2022-12-05 19:37:16', '2023-04-03 18:50:25'),
(43, 6, 'KEPEMIMPINAN YANG KONDUSIF', 'Memadai', 'Kurang Memadai', 'Adanya rapat internal yang diselenggarakan secara rutin   (coffee morning) setiap hari senin, dan telah tercipta  budaya kerja yang kondusif, Namun demikin masih perlu untuk terus ditingkatkan.', 'Budaya kerja yang kondusif telah tercipta', NULL, NULL, 'Dokumentasi rapat internal dan  Dokumen Pedoman Pola Pikir dan Budaya Kerja', 'Rapat rutin melibatkan semua pejabat struktural yang ada di Lingkungan Badan Pendapatan Daerah', 'Sekretaris', 'Setiap Minggu', 8, 45, '2022-12-05 19:37:16', '2023-04-03 18:50:25'),
(44, 6, 'PEMBENTUKAN STRUKTUR ORGANISASI YANG SESUAI DENGAN KEBUTUHAN', 'Kurang Memadai', 'Kurang Memadai', 'Struktur Organisasi telah disusun selaras dengan proses bisnis organisasi,  namun belum sampai ke tingkat SOP.', 'Struktur organisasi telah disusun selaras dengan proses bisnis', NULL, NULL, 'Dokumen Pembentukan Struktur Organisasi', 'Menyusun SOP selaras dengan proses  bisnis', 'Sekretaris', 'Mei 2023', 8, 45, '2022-12-05 19:37:16', '2023-04-03 18:50:25'),
