(78, 6, 'PENYUSUNAN DAN PENERAPAN KEBIJAKAN YANG SEHAT TENTANG PEMBINAAN SUMBER DAYA MANUSIA', 'Memadai', 'Kurang Memadai', '1). Belum menyusun talent pool dan rencana suksesi berdasarkan hasil penilaian kompetensi dan penilaian kinerja.\r\n2). Belum mengimplementasikan manajemen karier dengan mengacu pada talent pool dan rencana suksesi (manajemen talenta).\r\n3). Belum menetapkan kebijakan internal tentang pengisian Jabatan pimpinan Tinggi.\r\n4). Belum melakukan assesment dalam proses pengisian jabatan administrator dan pengawas.\r\n5). Belum memperluas penggunaan assesment center untuk penilaian kompetensi bagi seluruh pegawai.\r\n6). Belum melaksanakan analisis kesenjangan kompetensi dan kinerja beserta strategi yang harus dilakukan untuk mengatasi kesenjangan tersebut.\r\n7). Belum melaksanakan program coaching dan mentoring secara terjadwal dan dievaluasi.\r\n8). Belum melaksanakan dialog kinerja secara terjadwal.\r\n9). Belum melaksanakan monitoring dan evaluasi atas pelaksanaan strategi untuk mengatasi permasalahan kinerja.\r\n10). Belum melaksanakan dan mengevaluasi program pemberian penghargaan secara terjadwal berdasarkan peraturan yang telah ditetapkan.\r\n11). Belum mengintegrasikan e-kinerja dengan data pengembangan karier pegawai.\r\n12). Belum mengembangkan e-office lainnya dan mengintegrasikan dalam dashboard pimpinan.\r\n13). Pengembangan kompetensi hanya dilakukan pada sebagian pegawai/ belum dilakukan kepada seluruh pegawai.\r\n14). Instansi telah melakukan fasilitasi pengembangan kompetensi kepada sebagian pegawai/ belum kepada seluruh pegawai.', '1). Belum menyusun talent pool dan rencana suksesi berdasarkan hasil penilaian kompetensi dan penilaian kinerja.\r\n2). Belum mengimplementasikan manajemen karier dengan mengacu pada talent pool dan rencana suksesi (manajemen talenta).\r\n3). Belum menetapkan kebijakan internal tentang pengisian Jabatan pimpinan Tinggi.\r\n4). Belum melakukan assesment dalam proses pengisian jabatan administrator dan pengawas.\r\n5). Belum memperluas penggunaan assesment center untuk penilaian kompetensi bagi seluruh pegawai.\r\n6). Belum melaksanakan analisis kesenjangan kompetensi dan kinerja beserta strategi yang harus dilakukan untuk mengatasi kesenjangan tersebut.\r\n7). Belum melaksanakan program coaching dan mentoring secara terjadwal dan dievaluasi.\r\n8). Belum melaksanakan dialog kinerja secara terjadwal.\r\n9). Belum melaksanakan monitoring dan evaluasi atas pelaksanaan strategi untuk mengatasi permasalahan kinerja.\r\n10). Belum melaksanakan dan mengevaluasi program pemberian penghargaan secara terjadwal berdasarkan peraturan yang telah ditetapkan.\r\n11). Belum mengintegrasikan e-kinerja dengan data pengembangan karier pegawai.\r\n12). Belum mengembangkan e-office lainnya dan mengintegrasikan dalam dashboard pimpinan.\r\n13). Pengembangan kompetensi hanya dilakukan pada sebagian pegawai/ belum dilakukan kepada seluruh pegawai.\r\n14). Instansi telah melakukan fasilitasi pengembangan kompetensi kepada sebagian pegawai/ belum kepada seluruh pegawai.', NULL, NULL, 'Keputusan KASN Nomor 17/KEP.KASN/C/VII/2022 tentang Penerapan Sistem Merit dalam Manajemen ASN di Lingk. Pemkab. Lamongan.\r\nSurat Kepala BKN Nomor: 10575/B-AK.02.02/SD/F/2022 tentang Implementasi NSPK Manajemen ASN Tahun 2021', '1). Menyusun talent pool berdasarkan hasil uji kompetensi pada sebagian pegawai secara bertahap;\r\n2). Melaksanakan uji kompetensi pada proses pengisian JPT Pratama;\r\n3). Penyusunan dan penetapan Raperbup tentang proses pengisian jabatan pimpinan tinggi secara terbuka dan kompetitif;\r\n4). Proses pengisian jabatan administrator dan pengawas berdasarkan hasil penilaian oleh Tim Penilai Kinerja dan uji kompetensi;\r\n5). Penggunaan assesment center untuk penilaian kompetensi bagi sebagaian pegawai secara bertahap setiap tahun;\r\n6). Melaksanakan analisis kesenjangan kompetensi ASN dan analisis kebutuhan diklat (AKD) dan melaksanakan analisis kinerja pegawai melalui aplikasi E-Performance serta melaksanakan evaluasi atas dokumen penilaian kinerja pegawai;\r\n7). Melaksanakan mentoring antara atasan langsung dan bawahan serta terdokumentasikan dan terjadwal secara berkala;\r\n8) Melaksanakan dialog kinerja secara terstruktur dan terjadwal secara berkala pada aplikasi E-performance;\r\n9). Melaksanakan rapat untuk monev atas pelaksanaan strategi kinerja tribulanan;\r\n10). Melaksanakan program pemberian penghargaan melalui kompetisi;\r\n11). Menyediakan API untuk mengintegrasikan aplikasi E-Performance dan SIMEGILAN;\r\n12). Merencanakan dan membangun fitur khusus pimpinan dalam sistem informasi manajemen kepegawaian;\r\n13). Penyelenggaraan kediklatan pada seluruh pegawai dengan dukungan seluruh Perangkat Daerah secara mandiri;\r\n14). Melakukan fasilitasi pengembangan kompetensi kepada seluruh pegawai secara bertahap.', 'Kepala BKPSDM', 'Januari s/d Desember 2023', 5, 44, '2022-12-07 23:26:23', '2023-07-23 21:12:43'),
(79, 6, 'PERWUJUDAN PERAN APARAT PENGAWASAN INTERN PEMERINTAH YANG EFEKTIF', 'Memadai', 'Kurang Memadai', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 5, 44, '2022-12-07 23:26:23', '2023-07-23 21:12:43'),
(80, 6, 'HUBUNGAN KERJA YANG BAIK DENGAN INSTANSI PEMERINTAH TERKAIT', 'Memadai', 'Kurang Memadai', 'Hasil survey kepuasan masyarakat (ASN) terhadap pelayanan kepegawaian menunjukkan bahwa unsur pelayanan berdasarkan \"waktu penyelesaian, produk spesifikasi jenis pelayanan serta penanganan pengaduan, saran dan masukan\" mendapatkan nilai yang rendah dibandingkan dengan unsur yang lain.', 'Hasil survey kepuasan masyarakat (ASN) terhadap pelayanan kepegawaian menunjukkan bahwa unsur pelayanan berdasarkan \"waktu penyelesaian, produk spesifikasi jenis pelayanan serta penanganan pengaduan, saran dan masukan\" mendapatkan nilai yang rendah dibandingkan dengan unsur yang lain.', NULL, NULL, 'Hasil SKM BKPSDM Tahun 2022', '1) Reviu SOP Layanan Kepegawaian dan penetapan proses bisnis;\r\n2) Percepatan penanganan pengaduan melalui SP4N LAPOR, Lapor pak YES, website resmi BKPSDM dan Instagram BKPSDM;\r\n3) Peningkatan publikasi layanan kepegawaian.', 'Kepala BKPSDM', 'Januari s/d Desember 2023', 5, 44, '2022-12-07 23:26:23', '2023-07-23 21:12:43'),
(81, 2, 'PENEGAKAN INTEGRITAS DAN NILAI ETIKA', 'Memadai', 'Memadai', 'Harus melibatkan banyak pihak agar pengawasan kuat', 'Penegakan integritas di Dinas Ketahanan Pangan dan Pertanian sudah memadai, hanya saja penegakan atas pelanggaran kurang dan beberapa pegawai belum mengetahui adanya layanan pengaduan kode etik', NULL, NULL, 'SE Kode etik pegawai\r\nSP4N LAPOR', 'melaksanakan sosialisasi mengenai pengawasan kinerja aparat', 'kepala daerah', '1 tahun', 14, 21, '2022-12-11 18:39:36', '2023-04-01 00:24:27'),
(82, 2, 'KOMITMEN TERHADAP KOMPETENSI', 'Memadai', 'Memadai', 'Adanya mutasi  dan perubahan rencana kerja sehingga perlu pembaruan perjanjian kinerja', 'Komitmen terhadap kompetensi sudah memadai, namun masih ada 1-2 pegawai yang menduduki jabatan namun tidak sesuai dengan latar pendidikannya.', NULL, NULL, 'Perjanjian Kinerja Pegawai', 'memperkuat proses bisnis OPD', 'kepala dinas', '1 tahun', 14, 21, '2022-12-11 18:39:36', '2023-04-01 00:24:27'),
(83, 2, 'KEPEMIMPINAN YANG KONDUSIF', 'Memadai', 'Memadai', 'Penilaian harus obyektif', 'Bentuk kepemimpinan di DKPP sudah kondusif, namun penetapan kebijakan pengelolaan risiko perlu dipertegas arah kejelasannya', NULL, NULL, 'Survei kepuasan masyarakat intern Dinas', 'kuesioner IKM secara anonim', 'pelaksana kegiatan', '1 tahun', 14, 21, '2022-12-11 18:39:36', '2023-04-01 00:24:27'),
(84, 2, 'PEMBENTUKAN STRUKTUR ORGANISASI YANG SESUAI DENGAN KEBUTUHAN', 'Memadai', 'Memadai', 'SOTK masih perlu penyesuaian', 'Pembentukan struktur organisasi DKPP sudah sesuai dengan kebutuhan, hanya saja maasih terdapat pegawai kontrak yang jumlahnya cukup banyak', NULL, NULL, 'SOTK', 'melaksanakan pengajuan review SOTK', 'kepala daerah', '1 tahun', 14, 21, '2022-12-11 18:39:36', '2023-04-01 00:24:27'),
(85, 2, 'PENDELEGASIAN WEWENANG DAN TANGGUNG JAWAB YANG TEPAT', 'Memadai', 'Memadai', 'Adanya mutasi jabatan sehingga perlu pembuatan perjanjian kinerja baru', 'Pendelegasian wewenang dan tagung jawab sudah sesuai dengan bidang pengampu, namun review terhadap kewenangan perlu ditingkatakan', NULL, NULL, 'Perjanjian kinerja', 'memperkuat proses bisnis OPD', 'kepala dinas', '1 tahun', 14, 21, '2022-12-11 18:39:36', '2023-04-01 00:24:27'),
(86, 2, 'PENYUSUNAN DAN PENERAPAN KEBIJAKAN YANG SEHAT TENTANG PEMBINAAN SUMBER DAYA MANUSIA', 'Memadai', 'Memadai', 'Perlu memberikan reward and punisment atas kinerja yang dilaksanakan', 'Penerapan kebijakan pembinaan sumber daya manusia telah dilaksanakan sesuai dengan peraturan, hanya saja pemberlakuan reward and punishment perlu diperjelas pelaksanaannya', NULL, NULL, 'LHE Akuntabilitas Kinerja Tribulan IV tahuun 2022', 'Membuat kebijakan untuk memberikan reward and punishment bagi pegawai internal dinas', 'Kepala Dinas', '1 tahun', 14, 21, '2022-12-11 18:39:36', '2023-04-01 00:24:27'),
(87, 2, 'PERWUJUDAN PERAN APARAT PENGAWASAN INTERN PEMERINTAH YANG EFEKTIF', 'Memadai', 'Memadai', 'Kurangnya evaluasi terhadap penilaian resiko', 'Aparat pengawas intern telah melakukan tugas secara efektif dan secara periodik.', NULL, NULL, 'Dokumen Manajemen Resiko (Aps)', 'melaksanakan evaluasi resiko secara berkala intern OPD', 'kepala dinas', 'tiap tribulan', 14, 21, '2022-12-11 18:39:36', '2023-04-01 00:24:27'),
(88, 2, 'HUBUNGAN KERJA YANG BAIK DENGAN INSTANSI PEMERINTAH TERKAIT', 'Memadai', 'Memadai', 'Perlu notulensi dari sudut pandang semua OPD', 'DKPP memiliki hubungan kerja yang baik dengan instansi pemerintah lainnya.', NULL, NULL, 'Notulen rakor antar OPD', 'membuat kesepakatan pada notulensi', 'kepala dinas', 'ketika ada rapat lintas OPD', 14, 21, '2022-12-11 18:39:36', '2023-04-01 00:24:27'),
