(96, 2, 'HUBUNGAN KERJA YANG BAIK DENGAN INSTANSI PEMERINTAH TERKAIT', 'Kurang Memadai', 'Memadai', '1.  Lingkungan Pengendalian Program Pengembangan Pariwisata Masih Lemah\r\n2. Kegiatan Pengendalian Atas Pelaksanaan Program Pengembangan Pariwisata Belum Seluruhnya Memadai', 'Sudah Memadai', NULL, NULL, 'Laporan Hasil Audit Ketaatan  Pada Dinas Pariwisata Dan Kebudayaan Kabupaten Lamongan Tahun Anggaran 2022', '1. Meminta pengesahan Pengguna Anggaran atas program kerja Kepala Bidang Pengembangan Pariwisata tahun 2022 yang telah disusun\r\n2. Melaksanakan reviu periodik atas ketepatan dan keandalan indikator kinerja program/kegiatan;\r\n3. Menginfokan perbandingan realisasi kinerja dengan realisasi kinerja level nasional/internasional pada LKJiP tahun 2022\r\n4. Melengkapi Dokumen Rencana Aksi dengan penjelasn Langkah nyata aksi untuk pencapaian sasaran;\r\n5. Menindak lanjuti seluruh rekomendasi atas hasil evaluasi pencapaian kinerja;\r\n6. Memanfaatkan hasil evaluasi akuntabilitas kinerja untuk peningkatan SAKIP', 'Kepala Dinas Pariwisata Dan Kebudayaan', '12 Bulan', 18, 64, '2022-12-11 19:14:27', '2023-03-30 20:52:49'),
(97, 2, 'PENEGAKAN INTEGRITAS DAN NILAI ETIKA', 'Memadai', 'Memadai', 'Kondisi di OPD cukup memadai', 'Pemda telah memiliki aturan perilaku (misalnya kode etik, pakta integritas, dan aturan perilaku pegawai) yang telah dikomunikasikan kepada seluruh pegawai\r\nPenegakan integritas dan nilai etika sudah cukup memadai', NULL, NULL, 'Peraturan Bupati Lamongan Nomor 39 Tahun 2021 Tentang Nilai Dasar, Kode Etik dan Kode Perilaku Aparatur Sipil Negara', '-', '-', '-', 33, 25, '2022-12-11 20:51:24', '2023-08-07 01:06:25'),
(98, 2, 'KOMITMEN TERHADAP KOMPETENSI', 'Memadai', 'Memadai', 'Beberapa Kualifikasi Kebutuhan Tenaga Kerja di Dinas Tenaga Kerja Belum Terpenuhi', 'Setiap pegawai cukup aktif mengikuti kegiatan pelatihan dan pendidikan untuk meningkatkan kompetensi yang dibutuhkan', NULL, NULL, 'ANJAB DISNAKER', 'Mengajukan usul kebutuhan pegawai kepada Bkpsdm', 'Kepala Dinas Tenaga Kerja, Sekretaris, Kasubbag Umum dan Kepegawaian', 'Januari-Desember 2023', 33, 25, '2022-12-11 20:51:24', '2023-08-07 01:06:25'),
(99, 2, 'KEPEMIMPINAN YANG KONDUSIF', 'Memadai', 'Memadai', 'Kondisi di OPD cukup memadai', 'SAKIP Dinas Tenaga Kerja Kab. Lamongan  dengan nilai A (memuaskan) yang mencerminkan pemimpin yang kondusif dalam melaksanakan kinerja PD', NULL, NULL, 'Laporan Hasil Evaluasi SAKIP 2022', NULL, NULL, NULL, 33, 25, '2022-12-11 20:51:24', '2023-08-07 01:06:25'),
(100, 2, 'PEMBENTUKAN STRUKTUR ORGANISASI YANG SESUAI DENGAN KEBUTUHAN', 'Memadai', 'Memadai', 'Masih kurangnya penjelasan terkait pejabat fungsional\r\nMasih banyak jabtan yang diisi dengan pegawai tidak tetap', 'SOTK sudah terpenuhi meski masih perlu penyempurnaan', NULL, NULL, 'PERBUP Nomor 76 Tahun 2021 Tentang Kedudukan, Susunan Organisasi, Tugas dan Fungsi serta Tata Kerja Dinas Tenaga Kerja Kabupaten Lamongan', '-', 'Kepala Dinas Tenaga Kerja, Sekretaris, Kasubbag Umum dan Kepegawaian', 'Januari-Desember 2023', 33, 25, '2022-12-11 20:51:24', '2023-08-07 01:06:25'),
(101, 2, 'PENDELEGASIAN WEWENANG DAN TANGGUNG JAWAB YANG TEPAT', 'Memadai', 'Memadai', 'Beberapa Wewenang dan Tanggungjawab didelegasikan tidak sesuai dengan tugas yang tercantum dalam peraturan', 'Para pegawai perlu mempelajari wewenang dan tanggung jawab yang tercantum dalam peraturan agar pendelegasian sesuai dengan tupoksinya', NULL, NULL, 'PERBUP Nomor 76 Tahun 2021 Tentang Kedudukan, Susunan Organisasi, Tugas dan Fungsi serta Tata Kerja Dinas Tenaga Kerja Kabupaten Lamongan', 'Melaksanakan review pendelegasian wewenang dan tanggung jawab secara periodik', 'Kepala Dinas Tenaga Kerja', 'Januari-Desember 2023', 33, 25, '2022-12-11 20:51:24', '2023-08-07 01:06:25'),
(102, 2, 'PENYUSUNAN DAN PENERAPAN KEBIJAKAN YANG SEHAT TENTANG PEMBINAAN SUMBER DAYA MANUSIA', 'Memadai', 'Memadai', 'Masih banyak pegawai yang belum tepat waktu dalam menyampaikan capaian kinerjanya', 'Pemda telah memiliki Kebijakan dan prosedur pengelolaan SDM yang lengkap (sejak rekrutmen sampai dengan pemberhentian pegawai)\r\nKegiatan pelatihan dan pendidikan diikuti dengan baik oleh pegawai untuk meningkatkan sumber daya manusia', NULL, NULL, 'Dokumen Pengukuran Kinerja', NULL, NULL, NULL, 33, 25, '2022-12-11 20:51:24', '2023-08-07 01:06:25'),
(103, 2, 'PERWUJUDAN PERAN APARAT PENGAWASAN INTERN PEMERINTAH YANG EFEKTIF', 'Memadai', 'Memadai', 'Kurangnya evaluasi terhadap penilaian risiko', 'Tim SPIP perlu meningkatkan efektivitasnya dalam mewujudkan peran aparat pengawasan intern pemerintah yang efektif -', NULL, NULL, 'Dokumen manajemen risiko', 'Meningkatkan efektifitas Tim SPIP', 'Kepala Dinas Tenaga Kerja', 'Januari-Desember 2023', 33, 25, '2022-12-11 20:51:24', '2023-08-07 01:06:25'),
(104, 2, 'HUBUNGAN KERJA YANG BAIK DENGAN INSTANSI PEMERINTAH TERKAIT', 'Memadai', 'Memadai', 'Kondisi di OPD cukup memadai', 'Lebih intens menjalin komunikasi dengan  instansi pemerintah terkait  demi meningkatkan pelayanan kepada masyarakat', NULL, NULL, 'Telah terbangun hubungan kerja yang baik dengan instansi terkait', 'Meningkatkan komunikasi untuk menjalin kerjasama dan hubungan baik dengan OPD terkait', 'Kepala Dinas Tenaga Kerja', 'Januari-Desember 2023', 33, 25, '2022-12-11 20:51:24', '2023-08-07 01:06:25'),
