(145, 6, 'HUBUNGAN KERJA YANG BAIK DENGAN INSTANSI PEMERINTAH TERKAIT', 'Memadai', 'Kurang Memadai', 'BELUM ADANYA HASIL EVALUASI TERKAIT KERJASAMA YANG SUDAH BERJALAN', NULL, NULL, NULL, 'ADANYA KERJASAMA ANTAR OPD', 'melaksanakan evaluasi terkait kerjasama yang sudah berjalan', 'Bidang pemanfaatan data dan inovasi pelayanan', '1 bulan', 12, 49, '2022-12-12 22:53:49', '2023-07-06 20:49:41'),
(146, 4, 'PENEGAKAN INTEGRITAS DAN NILAI ETIKA', 'Memadai', 'Memadai', 'Sudah diterapkan namun perlu ditingkatkan lagi', 'Pimpinan telah mengedepankan kebijakan etika yang jelas dan diterapkan secara konsisten meskipun belum optimal', NULL, NULL, 'Peraturan Bupati Lamongan Nomor 39 Tahun 2021 Tentang Nilai Dasar,Kode Etik Dan Kode Perilaku Aparatur Sipil Negara', '1. Penegakan aturan dan prosedur yang jelas dan transparan dalam semua kegiatan dan proses di dinas.\r\n2. Pelatihan dan pengembangan staf dinas tentang etika dan integritas, termasuk prosedur pengaduan pelanggaran.\r\n3. Peningkatan pengawasan dan pengendalian internal untuk mengidentifikasi pelanggaran integritas dan memastikan bahwa mereka ditindaklanjuti dengan tegas.\r\n4. Pembentukan tim khusus atau divisi yang bertanggung jawab atas pemantauan dan pelaporan pelanggaran integritas.\r\n5. Pemberian sanksi tegas dan sesuai hukum bagi pelanggar integritas dan etika.', 'Kepala Dinas', '12 Bulan', 19, 34, '2022-12-13 01:39:03', '2023-04-03 21:46:01'),
(147, 4, 'KOMITMEN TERHADAP KOMPETENSI', 'Memadai', 'Memadai', 'Pegawai belum dapat menunjukkan komitmen, kesediaan dan tekad yang tinggi untuk mengembangkan dan meningkatkan kompetensi atau kemampuan kerja.', 'Pegawai sudah melaksanakan tugasnya namun belum dapat menunjukkan komitmen, kesediaan dan tekad yang tinggi untuk mengembangkan dan meningkatkan kompetensi atau kemampuan kerja', NULL, NULL, 'Dokumen Perjanjian Kinerja Pegawai', '1. Menetapkan tujuan dan sasaran pengembangan kompetensi yang spesifik dan terukur untuk setiap pegawai di dinas. Tujuan ini harus disesuaikan dengan tugas dan tanggung jawab pekerjaan mereka.\r\n\r\n2. Melakukan penilaian atau evaluasi kompetensi secara periodik untuk mengidentifikasi area di mana pegawai perlu ditingkatkan dan mengembangkan kemampuan kerja.\r\n\r\n3. Memberikan pelatihan dan pengembangan yang relevan dan tepat waktu, baik melalui pelatihan formal, seminar, atau kursus online. Pelatihan ini harus disesuaikan dengan tujuan pengembangan kompetensi masing-masing pegawai.\r\n\r\n4. Memberikan dukungan dan motivasi yang diperlukan kepada pegawai selama proses pengembangan kompetensi. Ini dapat dilakukan dengan memberikan pengakuan dan penghargaan atas upaya dan prestasi mereka.\r\n\r\n5. Mendorong dan mendukung pegawai untuk terus belajar dan mengembangkan kemampuan mereka melalui pembelajaran mandiri, seperti membaca buku, artikel, dan mengikuti forum diskusi.\r\n\r\n6. Memperlihatkan peran model dan menjunjung tinggi nilai-nilai seperti pembelajaran sepanjang hayat dan pengembangan diri sebagai bagian dari budaya kerja di dinas.', 'Kasubag Umum', '12 Bulan', 19, 34, '2022-12-13 01:39:03', '2023-04-03 21:46:01'),
(148, 4, 'KEPEMIMPINAN YANG KONDUSIF', 'Memadai', 'Memadai', '-', 'Pimpinan mampu menciptakan lingkungan kerja yang positif dan mendukung kemajuan karyawan serta organisasi secara keseluruhan. Meskipun belum maksimal', NULL, NULL, '-', '-', '-', '-', 19, 34, '2022-12-13 01:39:03', '2023-04-03 21:46:01'),
