(151, 4, 'PENYUSUNAN DAN PENERAPAN KEBIJAKAN YANG SEHAT TENTANG PEMBINAAN SUMBER DAYA MANUSIA', 'Memadai', 'Memadai', 'Penerapan kebijakan belum optimal karena Kerangka Acuan Kerja (KAK) dan Standar Operasional Prosedur (SOP) belum disusun', 'Sudah menerapkan kebijakan yang sehat tentang pembinaan sumber daya manusia meskipun belum optimal.', NULL, NULL, 'Dokumen Laporan Hasil Audit (LHA) Ketaatan tahun 2022', 'Sudah dibuatkan Kerangka Acuan Kerja (KAK) dan Standar Operasional Prosedur (SOP)', 'Kasubag Program dan Keuangan', '1 Bulan', 19, 34, '2022-12-13 01:39:03', '2023-04-03 21:46:01'),
(152, 4, 'PERWUJUDAN PERAN APARAT PENGAWASAN INTERN PEMERINTAH YANG EFEKTIF', 'Memadai', 'Memadai', 'Penerapan sistem pengendalian intern pemerintah telah terpenuhi dengan cukup baik namun perlu ditingkatkan lagi', 'Sudah mengambil tindakan perbaikan yang tepat dan efektif untuk memastikan kinerja dan pelayanan yang lebih baik kepada masyarakat namun perlu dimaksimalkan lagi', NULL, NULL, 'Dokumen Laporan Hasil Audit (LHA) Ketaatan Tahun 2022', 'Perlu dilibatkan seluruh pegawai dan pejabat pemerintah untuk memastikan bahwa pengendalian internal diterapkan secara konsisten dan efektif di semua tingkat.', 'Kasubag Program dan Keuangan', '12 Bulan', 19, 34, '2022-12-13 01:39:03', '2023-04-03 21:46:01'),
(153, 4, 'HUBUNGAN KERJA YANG BAIK DENGAN INSTANSI PEMERINTAH TERKAIT', 'Memadai', 'Memadai', 'Sudah dijalankan namun perlu ditingkatkan', 'Sudah menerapkan hubungan kerja yang baik antar OPD meskipun belum optimal', NULL, NULL, 'Rapat Koordinasi Forum OPD 2023', '1. Memiliki agenda rapat yang jelas\r\n2. Menetapkan tujuan rapat yang jelas.\r\n3. Mengundang peserta rapat yang tepat\r\n4. Memimpin rapat dengan baik\r\n5. Memberikan kesempatan untuk diskusi\r\n6. Mencatat hasil rapat', 'Kasubag Program dan Keuangan', '12 Bulan sekali', 19, 34, '2022-12-13 01:39:03', '2023-04-03 21:46:01'),
