(178, 6, 'PENEGAKAN INTEGRITAS DAN NILAI ETIKA', 'Memadai', 'Kurang Memadai', '-', 'Penegakan Integritas dan Nilai Etika di Dinas PMD Kabupaten Lamongan dinilai \"Memadai\", terutama Dinas PMD Kabupaten Lamongan telah memiliki aturan perilaku (misalnya kode etik, pakta integritas, dan aturan perilaku pegawai) yang telah dikomunikasikan kepada seluruh pegawai', NULL, NULL, '-', '-', '-', '-', 21, 15, '2023-01-08 21:59:18', '2023-08-10 01:27:25'),
(179, 6, 'KOMITMEN TERHADAP KOMPETENSI', 'Memadai', 'Kurang Memadai', '-', 'Komitmen Terhadap Kompetensi di Dinas PMD Kabupaten Lamongan dinilai \"Memadai\", terutama Dinas PMD Kabupaten Lamongan telah memiliki dan menerapkan strategi peningkatan kompetensi pegawai', NULL, NULL, '-', '-', '-', '-', 21, 15, '2023-01-08 21:59:18', '2023-08-10 01:27:25'),
(180, 6, 'KEPEMIMPINAN YANG KONDUSIF', 'Memadai', 'Kurang Memadai', '-', 'Kepemimpinan yang Kondusif di Dinas PMD Kabupaten Lamongan dinilai \"Memadai\", terutama Pimpinan menetapkan Sasaran strategis yang selaras dengan visi dan misi Dinas PMD Kabupaten Lamongan', NULL, NULL, '-', '-', '-', '-', 21, 15, '2023-01-08 21:59:18', '2023-08-10 01:27:25'),
(181, 6, 'PEMBENTUKAN STRUKTUR ORGANISASI YANG SESUAI DENGAN KEBUTUHAN', 'Memadai', 'Kurang Memadai', '-', 'Pembentukan Struktur Organisasi yang Sesuai dengan Kebutuhan di Dinas PMD Kabupaten Lamongan dinilai \"Memadai\", terutama Adanya transparansi dan ketepatan waktu pelaporan pelaksanaan peran dan tanggung jawab masing-masing dalam pengelolaan risiko', NULL, NULL, '-', '-', '-', '-', 21, 15, '2023-01-08 21:59:18', '2023-08-10 01:27:25'),
(182, 6, 'PENDELEGASIAN WEWENANG DAN TANGGUNG JAWAB YANG TEPAT', 'Memadai', 'Kurang Memadai', '-', 'Pendelegasian Wewenang dan Tanggung Jawab yang Tepat di Dinas PMD Kabupaten Lamongan dinilai \"Memadai\", terutama Pendelegasian wewenang dan tanggung jawab dilaksanakan secara tepat', NULL, NULL, '-', '-', '-', '-', 21, 15, '2023-01-08 21:59:18', '2023-08-10 01:27:25'),
(183, 6, 'PENYUSUNAN DAN PENERAPAN KEBIJAKAN YANG SEHAT TENTANG PEMBINAAN SUMBER DAYA MANUSIA', 'Memadai', 'Kurang Memadai', '-', 'Penyusunan dan Penerapan Kebijakan yang Sehat tentang Pembinaan Sumber Daya Manusia di Dinas PMD Kabupaten Lamongan dinilai \"Memadai\", terutama Dinas PMD Kabupaten Lamongan telah menginternalisasi budaya sadar risiko', NULL, NULL, '-', '-', '-', '-', 21, 15, '2023-01-08 21:59:18', '2023-08-10 01:27:25'),
(184, 6, 'PERWUJUDAN PERAN APARAT PENGAWASAN INTERN PEMERINTAH YANG EFEKTIF', 'Kurang Memadai', 'Kurang Memadai', 'Perlu untuk meningkatkan pemahaman dalam penyusunan SPIP terintegrasi, Indeks Penerapan Manajemen Risiko (MRI) dan Indeks Efektivitas Pengendalian Korupsi (IEPK).', 'Perwujudan Peran Aparat Pengawasan Intern Pemerintah Efektif pada Dinas PMD Kabupaten Lamongan dinilai Inspektorat Daerah melakukan reviu atas efisiensi/ efektivitas pelaksanaan setiap urusan/program Secara periodik', NULL, NULL, 'Laporan Hasil Kegiatan Asistensi/ Pendampingan Sistem Pengendalian Intern Pemerintah (SPIP) Tahun 2022 pada 10 OPD pada Inspektur Pembantu Wilayah III Inspektorat Kabupaten Lamongan - Nomor : 700/511/LHP/413.201/2022 Tanggal 04 Oktober 2022', 'Mengadakan Kegiatan Rapat Koordinasi antar Bidang di Dinas PMD Kabupaten Lamongan', 'Kepala Dinas PMD Kabupaten Lamongan', 'Januari-Desember', 21, 15, '2023-01-08 21:59:18', '2023-08-10 01:27:25'),
(185, 6, 'HUBUNGAN KERJA YANG BAIK DENGAN INSTANSI PEMERINTAH TERKAIT', 'Memadai', 'Kurang Memadai', '-', 'Hubungan Kerja yang baik dengan Instansi Pemerintah terkait, untuk Dinas PMD Kabupaten Lamongan dinilai \"Memadai\", terutama Hubungan kerja yang baik dengan instansi yang terkait atas fungsi pengawasan/ pemeriksaan (inspektorat, BPKP, dan BPK) telah terbangun', NULL, NULL, '-', '-', '-', '-', 21, 15, '2023-01-08 21:59:18', '2023-08-10 01:27:25'),
(186, 3, 'PENEGAKAN INTEGRITAS DAN NILAI ETIKA', 'Memadai', 'Memadai', 'Masih ada beberapa pegawai yang tidak patuh terhadap peraturan', 'Pelanggaran aturan perilaku/kode etik belum ditindaklanjuti sesuai ketentuan yang berlaku', NULL, NULL, 'RSUD Karangkembang', '1. Internalisasi peraturan melalui sosialisasi maupun penyampaian saat melakukan apel pagi kepada seluruh pegawai rumah sakit\r\n2. Menyusun dan mensosialisikan kode etik ke seluruh pegawai RSUD Karangkembang Kabupaten Lamongan \r\n3. Menegakkan tindakan disiplin yang tepat atas penyimpangan terhadap kebijakan dan prosedur atau pelanggaran terhadap kode etik', 'Sub Bagian Umum, Kepegawaian, dan Keuangan', '3 Bulan', 76, 61, '2023-01-18 18:48:58', '2023-08-03 20:09:42'),
(187, 3, 'KOMITMEN TERHADAP KOMPETENSI', 'Memadai', 'Kurang Memadai', 'Pengembangan pegawai sesuai dengan kompetensi masih belum optimal', 'Pegawai yang kompeten belum secara tepat mengisi posisi/jabatan', NULL, NULL, 'RSUD Karangkembang', '1. Menyusun Standar Prosedur Operasional untuk setiap tugas dan fungsi pada masing-masing posisi pada RSUD Karangkembang\r\n2. Mengidentifikasi dan menetapkan kegiatan yang dibutuhkan untuk menyelesaikan tugas dan fungsi pada masing-masing posisi di RSUD Karangkembang\r\n3. Menyelenggarakan pelatihan dan pembimbingan untuk membantu pegawai meningkatkan kompetensi kinerja di RSUD Karangkembang', 'Direktur', '3 Bulan', 76, 61, '2023-01-18 18:48:58', '2023-08-03 20:09:42'),
(188, 3, 'KEPEMIMPINAN YANG KONDUSIF', 'Memadai', 'Kurang Memadai', 'Pengelolaan terhadap resiko belum optimal', '-', NULL, NULL, 'RSUD Karangkembang', '1. Membentuk Tim Mutu RSUD Karangkembang\r\n2. Mengambil keputusan selalu mendasarkan pada data hasil penilaian risiko\r\n3. Mengarahkan seluruh sumber daya dan potensi RSUD Karangkembang untuk melakukan perubahan dalam rangka mencapai kinerja yang lebih baik', 'Seksi Pelayanan', '2 Bulan', 76, 61, '2023-01-18 18:48:58', '2023-08-03 20:09:42'),
(189, 3, 'PEMBENTUKAN STRUKTUR ORGANISASI YANG SESUAI DENGAN KEBUTUHAN', 'Memadai', 'Memadai', 'Masih banyaknya SDM bekerja yang tidak sesuai dengan tupoksi', '-', NULL, NULL, 'RSUD Karangkembang', '1. Menyesuaikan dengan ukuran dan sifat kegiatan RSUD Karangkembang berdasarkan SOTK RSUD Karangkembang\r\n2. Memberikan kejelasan wewenang dan tanggung jawab pimpinan masing-masing pejabat dalam RSUD Karangkembang', 'Direktur', '6 Bulan', 76, 61, '2023-01-18 18:48:58', '2023-08-03 20:09:42'),
(190, 3, 'PENDELEGASIAN WEWENANG DAN TANGGUNG JAWAB YANG TEPAT', 'Memadai', 'Memadai', 'Masih ada wewenang dan tanggungjawab yang masih kurang tepat dalam pendelegasian', '-', NULL, NULL, 'RSUD Karangkembang', '1. Melakukan review dan evaluasi secara periodik dalam pendelegasian wewenang dan tanggungjawab\r\n2. Wewenang diberikan kepada pegawai yang sesuai dengan tingkat tanggung jawabnya dalam rangka pencapaian tujuan RSUD Karangkembang', 'Direktur', '6 Bulan', 76, 61, '2023-01-18 18:48:58', '2023-08-03 20:09:42'),
(191, 3, 'PENYUSUNAN DAN PENERAPAN KEBIJAKAN YANG SEHAT TENTANG PEMBINAAN SUMBER DAYA MANUSIA', 'Memadai', 'Memadai', 'Anggaran untuk pengembangan SDM masih terbatas', '-', NULL, NULL, 'RSUD Karangkembang', 'Berkoordinasi dengan BKPSDM Pemerintah Kabupaten Lamongan terkait program pengembangan SDM', 'Sub Bagian Umum, Kepegawaian, dan Keuangan', '1 Tahun', 76, 61, '2023-01-18 18:48:58', '2023-08-03 20:09:42'),
(192, 3, 'PERWUJUDAN PERAN APARAT PENGAWASAN INTERN PEMERINTAH YANG EFEKTIF', 'Memadai', 'Memadai', 'Temuan dan saran belum sepenuhnya ditindaklanjuti', '-', NULL, NULL, 'RSUD Karangkembang', '1. Penyusunan rencana tindak lanjut terhadap temuan dan saran/rekomendasi pengawasan APIP\r\n2. Meningkatkan efektivitas manajemen risiko dalam penyelenggaraan tugas dan fungsi RSUD Karangkembang\r\n3. Meningkatkan kualitas tata kelola penyelenggaraan tugas dan fungsi RSUD Karangkembang', 'Sub Bagian Umum, Kepegawaian, dan Keuangan', '2 Bulan', 76, 61, '2023-01-18 18:48:58', '2023-08-03 20:09:42'),
(193, 3, 'HUBUNGAN KERJA YANG BAIK DENGAN INSTANSI PEMERINTAH TERKAIT', 'Memadai', 'Memadai', 'Masih kurangnya komunikasi dan koordinasi dengan instansi pemerintah terkait', '-', NULL, NULL, 'RSUD Karangkembang', '1. Meningkatkan komunikasi dengan instansi pemerintah terkait sesuai dengan bidangnya masing-masing\r\n2. Diwujudkan dengan adanya mekanisme hubungan kerjasama yang baik antar instansi yang terkait dengan rapat-rapat koordinasi antar Satuan Kerja Perangkat Daerah (SKPD)', 'RSUD Karangkembang', '2 Bulan', 76, 61, '2023-01-18 18:48:58', '2023-08-03 20:09:42'),
