(218, 2, 'PENEGAKAN INTEGRITAS DAN NILAI ETIKA', 'Memadai', 'Memadai', '1. Pemantauan\r\n2. Kontrol Sosial\r\n3. Pembaruan aturan perilaku\r\n4. Aturan perilaku sebagai target kinerja\r\n5. Audit etika', 'Pengembangan berkelanjutan merupakan langkah agar secara kontinu aturan perilaku termonitor pelaksanaanya sehingga setiap kelemahan dapat dirumuyskan rencana tindak yang tepat', NULL, NULL, 'PP No. 42 TH 2004 tentang pembinaan jiwa korps dan kode etik PNS', 'Dengan pengembangan berkelanjutan merupakan langkah kontinu dengan aturan perilaku yang termonitor pelaksanaannya sehingga setiap kelemahan dapat dirumuskan rencana tindak yang tepat', 'Kepala Dinas', '1 bulan', 24, 6, '2023-02-12 18:20:21', '2023-03-16 00:57:19'),
(219, 2, 'KOMITMEN TERHADAP KOMPETENSI', 'Memadai', 'Memadai', 'Penerapan sanksi kurang jelas penetapannya', 'Hendaknya dapat mengembangkan lebih jauh langkah- langkah yang perlu diambil sesuai dengan kebutuhan organisasi dengan tetap mengacu dan tidak bertentangan dengan peraturan perundang- undangan yang berlaku', NULL, NULL, '- Perjanjian kinerja DPMPTSP\r\n- Maklumat pelayanan', 'Hendaknya dapat mengembangkan lebih jauh langkah2yang perlu diambil sesuai dengan kebutuhan organisasi dengan mengacu dan tidak bertentangan dengan Peraturan perundang- undangan ang berlaku', 'Kepala Dinas', '1 bulan', 24, 6, '2023-02-12 18:20:21', '2023-03-16 00:57:19'),
(220, 2, 'KEPEMIMPINAN YANG KONDUSIF', 'Memadai', 'Memadai', 'Pemahaman dan penerapan menjadi komitmen bersama instansi pemerintah dan dilaksanakan dengan konsisten', 'Kepemimpinan yang mampu menggerakkan organisasi untuk melaksanakan program dan kegiatan dalam rangka pencapaian tujuan organisasi', NULL, NULL, 'Pimpinan sebagai narasumber dibeberapa OPD/Instansi lainnya', 'Dengan menggerakan anggota untuk melaksanakan program dan kegiatan dalam rangka pencapaian tujuan organisasi', 'Kepala Dinas', '1 bulan', 24, 6, '2023-02-12 18:20:21', '2023-03-16 00:57:19'),
(221, 2, 'PEMBENTUKAN STRUKTUR ORGANISASI YANG SESUAI DENGAN KEBUTUHAN', 'Memadai', 'Memadai', '- Perkembangan skil dan wawasan lambat\r\n- Pembuatan keputusan harus melewati birokrasi yang panjang\r\n- Membentuk organisasi yang sulit menerima perubahan', 'Penyelenggaraan pembentukan struktur organisasi yang sesuai dengan kebutuhan diawali dengan pemahaman bersama melalui sosialisasi dengan media yang ada selanjutnya dilakukan pemetaan', NULL, NULL, 'Perbup No 71 Tahun 2021 tentang kedudukan susunan organisasi, tugas dan fungsi serta tata kerja Dinas Penanaman Modal ab PTSP Kabupaten lamongan', 'Dengan pembentukan Struktur Organisasi yang sesuai dengan kebutuhan dan pemahaman bersama melalui sosialisasi dengan media yang ada selanjutnya dilakukan pemetaan', 'Kepala Dinas', '3 bulan', 24, 6, '2023-02-12 18:20:21', '2023-03-16 00:57:19'),
(222, 2, 'PENDELEGASIAN WEWENANG DAN TANGGUNG JAWAB YANG TEPAT', 'Memadai', 'Memadai', 'Memungkinkan Sub bagian atau bawahan mempelajari sesuatu yang baru dan memperoleh kesempatan untuk melakukan sesuatu yang baru dan memperoleh kesempatan untuk melakukan sesuatu yang baru tersebut (Pengembangan kapasitas bawahan)', 'Berbagai tanggung jawab mampu menciptakan rasa kebersamaan dalam menghasilkan kesuksesan. Tidak hanya itu, pegawai juga akan menjadi lebih produktif, kompeten dan percaya diri dalam mengerjakan tugas', NULL, NULL, 'Perbup 48 Tahun 2017 tentang pendelegasian wewenang perizinan', 'Dengan tanggung jawab mampu menciptakan rasa kersamaan dalam menghasilkan kesuksesan, pegawai juga akan menjadi lebih produktif, kompeten dan percaya diri dalam mengerjakan tugas', 'Kepala Dinas', '1 tahun', 24, 6, '2023-02-12 18:20:21', '2023-03-16 00:57:20'),
(223, 2, 'PENYUSUNAN DAN PENERAPAN KEBIJAKAN YANG SEHAT TENTANG PEMBINAAN SUMBER DAYA MANUSIA', 'Memadai', 'Memadai', 'Tidak melakukan pemantauan dan evaluasi secara berkala', 'Hal yang mendasar berlaku secara umum bagi seluruh instansi, minima harus dipenuhi dfalam penyelengaraankebijakan yang seha tentang pembinaanSDM dan tidak mengatur secara spesifik bagi instansi tertentu', NULL, NULL, 'Peta jabatan (Bagor) dan SK kenaikan pangkat SKP (BKPSDM)', 'Mengembangkan kompetensi SDM dan mengikuti pelatihan2 dengan pemantauan secara berkala', 'Kepala Dinas', '1 tahun', 24, 6, '2023-02-12 18:20:21', '2023-03-16 00:57:20'),
(224, 2, 'PERWUJUDAN PERAN APARAT PENGAWASAN INTERN PEMERINTAH YANG EFEKTIF', 'Memadai', 'Memadai', 'Dalam pelaksanaan kegiatan yang menyebabkan tidak tercapainya target atau tujuan dan berulangnya kejadian serupa', 'Titik berat pelaksanaan tugas pengawasan dan pemeriksaan adalah tinkan preventif yaitu mencegah terjadinya kesalahan dalam pelaksanaan program dan kegiatan oleh Satuan Kerja Pemerintah Daerah (SKPD)serta memperbaiki kesalahan yang telah terjadi untuk dijadikan pelajaran agar kesalahan-kesalahan tersebut tidak terulang kembali di masa yang akan datang.', NULL, NULL, 'Laporan hasil evaluasi audit (Inspektorat) laporan kinerja', 'Melakukan tindakan prefentif yaitu mencegah terjadinya kesalahan dengan memperbaiki kesalahan yang terjadi dan tidak terulang kembali', 'Kepala Dinas', '1 tahun', 24, 6, '2023-02-12 18:20:21', '2023-03-16 00:57:20'),
