(363, 6, 'KOMITMEN TERHADAP KOMPETENSI', 'Memadai', 'Kurang Memadai', 'ADA BEBERAPA ASN YANG BEKERJA TIDAK SESUAI DENGAN DESKJOB YANG ADA DI ANJAB', 'ASN di Bagian Perencanaan dan Keuangan sudah bekerja sesuai dengan TUSI dan PK masing-masing ASN, tetapi masih ditemukan ada beberapa, tidak banyak sedikit sekali yang bekerja tidak sesuai dengan TUSI, PK dan Deskjob atau kompetensi yang dimilikinya, maka diperlukan adanya evaluasi lagi, sedikit saja agar menjadi sempurna.', NULL, NULL, 'ANJAB BAGIAN PERENCANAAN DAN KEUANGAN', 'SOSIALISASI TERKAIT ANJAB KEPADA OPD TERKAIT', 'BAGIAN ORGANISASI', '1-2 HARI', 71, 59, '2023-03-15 05:59:36', '2023-07-04 01:36:10'),
