(686, 4, 'PENDELEGASIAN WEWENANG DAN TANGGUNG JAWAB YANG TEPAT', 'Memadai', 'Memadai', 'Kondisi di OPD cukup memadai', 'Kondisi di OPD cukup memadai', NULL, NULL, 'Surat Keputusan Kepala Dinas Nomor: 100.3.3/43/Kep./413.122/2023 tentang Pembentukan dan Pengangkatan PPTK di Lingkungan Dinas Kearsipan dan Perpustakaan Daerah Kabupaten Lamongan Tahun Anggaran 2023 tanggal 2 Januari 2023', 'Kondisi di OPD cukup memadai namun tetap melaksanakan koordinasi dan sosialisasi SOP terkait pendelegasian wewenang terkait batasan kewenangan kepada seluruh pegawai Dinas Kearsipan dan Perpustakaan Daerah Kabupaten Lamongan', 'Dinas Kearsipan dan Perpustakaan Daerah', 'Januari - Desember 2023', 11, 118, '2023-07-10 00:42:15', '2023-07-10 21:24:56'),
(687, 4, 'PENYUSUNAN DAN PENERAPAN KEBIJAKAN YANG SEHAT TENTANG PEMBINAAN SUMBER DAYA MANUSIA', 'Memadai', 'Memadai', 'Kondisi di OPD cukup memadai', 'Kondisi di OPD cukup memadai', NULL, NULL, 'EPerformance', 'Kondisi di OPD cukup memadai namun tetap melakukan sosialisasi terkait kebijakan dan prosedur pengelolaan SDM sesuai peraturan perundang-undangan terbaru (Peraturan Pemerintah RI Nomor 11 Tahun 2017 tentang Manajemen Pegawai Negeri Sipil)', 'Dinas Kearsipan dan Perpustakaan Daerah', 'Januari - Desember 2023', 11, 118, '2023-07-10 00:42:15', '2023-07-10 21:24:56'),
(688, 4, 'PERWUJUDAN PERAN APARAT PENGAWASAN INTERN PEMERINTAH YANG EFEKTIF', 'Memadai', 'Memadai', 'Kondisi di OPD cukup memadai', 'Kondisi di OPD cukup memadai', NULL, NULL, 'Laporan Hasil Audit Ketaatan Inspektorat Nomor: 700/523/LHP/413.201/2022 tanggal 27 Oktober 2022', 'Kondisi di OPD cukup memadai namun tetap memantau wewenang yang diberikan kepada pegawai agar sesuai dengan tanggung jawabnya dalam rangka pencapaian tujuan penyelenggaraan tugas dan fungsi Instansi Pemerintah', 'Dinas Kearsipan dan Perpustakaan Daerah', 'Januari - Desember 2023', 11, 118, '2023-07-10 00:42:15', '2023-07-10 21:24:56'),
(689, 4, 'HUBUNGAN KERJA YANG BAIK DENGAN INSTANSI PEMERINTAH TERKAIT', 'Memadai', 'Memadai', 'Kondisi di OPD cukup memadai', 'Kondisi di OPD cukup memadai', NULL, NULL, 'Laporan Hasil Audit Ketaatan Inspektorat Nomor: 700/523/LHP/413.201/2022 tanggal 27 Oktober 2022', 'Kondisi di OPD cukup memadai namun tetap melanjutkan hubungan kerjasama yang baik antar instansi yang terkait dengan rapat-rapat koordinasi antar SKPD serta adanya pemeriksaan rutin dari BPK dan Inspektorat', 'Dinas Kearsipan dan Perpustakaan Daerah', 'Januari - Desember 2023', 11, 118, '2023-07-10 00:42:15', '2023-07-10 21:24:56');
